al\' => \'2017-02-01\',\n  \'fecha_evaluacion_final\' => \'2017-02-14\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino, de 50 años de edad con diagnostico medico de fractura de menisco derecho y artroscopia. Ingresa al servicio de fisioterapia realizando marcha de tres puntos de manera inadecuada. presenta dolor en rodilla derecha de 7/10 al reposo y al movimiento de flexion y extension de rodilla. Presenta edema de 4cm en rodilla respecto al otro miembro y espasmos musculares en cuadriceps femoral, tibial anterior y peroneos bilateral. presenta disminucion del rango de movimiento para la flexion de rodilla derecha de 0-90° y  alteracion de los patrones de movimiento para MID siendo malos por restriccion en las descargas de peso. Lo anterior la limita en las actividades de la vida diaria y su participación en su rol laboral.\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_cliente\' => \'21\',\n  \'fecha_registro\' => \'2017-02-02 18:38:29\',\n)','2017-02-02 16:38:29'),(988,5,'186.144.76.191',3,'sesion_sub_paquete',20,'Delete sesion_sub_paquete data:row(20)','2017-02-03 05:52:17'),(989,5,'186.144.76.191',3,'cliente_sub_paquete',20,'Delete cliente_sub_paquete data:row(20)','2017-02-03 05:52:17'),(990,5,'186.144.76.191',1,'cliente_sub_paquete',23,'Insert cliente_sub_paquete data:array (\n  \'fecha_inicio\' => \'2017-02-03\',\n  \'fecha_limite\' => \'2017-03-03 00:00:00\',\n  \'id_sub_paquete\' => \'16\',\n  \'descuento\' => \'0\',\n  \'total_pagar\' => \'620000\',\n  \'id_cliente\' => \'19\',\n  \'fecha_pago\' => \'2017-02-03\',\n)','2017-02-03 05:53:03'),(991,5,'186.144.76.191',1,'sesion_sub_paquete',391,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'23\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-02-03\',\n  \'numero\' => 1,\n)','2017-02-03 05:53:03'),(992,5,'186.144.76.191',1,'sesion_sub_paquete',392,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'23\',