historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Hector Garcia\',\n  \'plan_tratamiento\' => \'-Crioterapia, masaje con hielo durante 12 minutos.\r\n\r\n-masaje sedativo en zonas de espasmos y masaje de drenaje en zona infraclavicular y esternal izquierda.\r\n\r\n-TENS de intensidad sensitivo en zona de espasmos.\r\n\r\n-Estiramiento mantenido para pectoral mayor y menor bilateral.\r\n\r\n- TFNP, sostener- relajar para pectoral mayor.\r\n     Isometricas alternas para cabeza y cuello.\r\n\r\n- Ejercicios de fortalecimiento con resistencia manual y externa en diagonales de movimiento.\',\n  \'diagnostico\' => \'Procedimiento estetico; Mamoplastia\',\n  \'fecha_evaluacion_inicial\' => \'2017-01-26\',\n  \'fecha_evaluacion_final\' => \'2017-02-09\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino, de 23 años de edad con diagnostico medico de mamoplastia de 400cc hace aproximadamente 5 meses de evolución (realizada el 5 de octubre). Quien presenta dolor en la zona mamaria bilateral de 5/10 al movimiento  de flexion de hombro de 2/10 a la palpación  y de 1/10 al reposo que le limitan al realizar actividades de la vida diaria como peinarse y al realizar alcances por encima de la cabeza. presenta retracciones del pectoral mayor y menor bilateralmente y espasmos en mismo musculo y trapecio fibras superiores. se observa edema en zona infraclavicular izquierda. presenta patrones de movimiento buenos para MMSS por disminución del rango de movimiento (flexion de hombro de 0-140° y abd de 0-160° bilateral). Lo anterior le limita las actividades de la vida diaria y su participación en su rol estudiantil.\',\n  \'evaluacion_final\' => \'Paciente de género femenino, de 23 años de edad con diagnóstico médico de mamoplastia de 400cc hace aproximadamente 5 meses de evolución (realizada el 5 de octubre). Quien después de 10 sesiones de fisioterapia presenta  disminución del dolor en la zona mamaria bilateral de 1/10 al movimiento  de flexión de hombro de 1/10 a la palpación  y de 0/10 al reposo no le limita para realizar ninguna actividad. No presenta retracciones del pectoral mayor ni menor y espasmos en  presenta disminución de los espasmos en musculo trapecio fibras superiores y del pectoral mayor bilateralmente. No se observa edema en zona infraclavicular izquierda. Presenta patrones de movimiento buenos y rangos de movimiento normales en MMSS. No presenta restricción en la participación de ninguno de sus roles.\',\n  \'sesiones_realizadas\' => \'10.00\',\n)','2017-02-10 14:45:56'),(1207,5,'186.144.76.191',2,'cliente_historia_clinica',3,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dra. Erika Tatiana Mantilla Orozco\',\n  \'plan_tratamiento\' => \'Crioterapia, masaje con hielo.\r\n\r\nTermoterapia, paquete caliente en musculatura de manguito rotador.\r\n\r\nTens nivel sensitivo.\r\n\r\nUltrasonido pulsado con objetivo de reparar tejido lesionado.\r\n\r\nMasaje sedativo dirigido a espasmos musculares.\r\n\r\nAproximaciones y tracciones articulares suaves.\r\nEjercicios de codman.\r\n\r\nTFNP, isometicas alternas y estabilizacion ritmica en cintura escapular y MMSS\',\n  \'diagnostico\' => \'Tendinitis del subraespinoso e infraespinoso\r\nTenosinovitis de la cabeza larga del biceps braquial\r\nArtrosis acromioclavicular\',\n  \'fecha_evaluacion_inicial\' => \'2017-01-30\',\n  \'fecha_evaluacion_final\' => \'2017-02-10\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino, de 58 años de edad quien ingresa al servicio con el MSD adosado al cuerpo.  Presenta dolor de 8/10 al movimiento de flexión, abducción y rotación de hombro, presenta espasmos fibras superiores del trapecio bilateral, supraespinoso, infraespinoso y bíceps braquial derecho, disminución del rango de movimiento para la flexión y abd de hombro derecho de 160°, Disminución generalizada de la fuerza de hombro derecho. Presenta patrón de movimiento regular para MSD por disminución del rango de movimiento, de la fuerza y alteración en la funcionalidad. A la evaluación de las pruebas especificas de hombro presenta positivas hawkins y kennedy, maniobra de hobe speed y patte. no se realizan pruebas de longitud muscular por presencia de dolor. Lo anterior altera sus actividades de la vida diaria y su participación en su rol laboral.\',\n  \'evaluacion_final\' => \'Paciente de genero femenino, de 58 años de edad quien ingresa al servicio con el MSD adosado al cuerpo.  Presenta disminucion del dolor de 6/10 al movimiento de flexión, abducción y rotación de hombro, presenta disminucion de espasmos en fibras superiores del trapecio bilateral, supraespinoso, infraespinoso y bíceps braquial derecho, aumento su del rango de movimiento para la flexión y abd de hombro derecho de  0-170° aunque aun presenta dolor a la mitad del rango, Presenta patrón de movimiento regular para MSD por disminución del rango de movimiento, de la fuerza y alteración en la funcionalidad. Lo anterior altera sus actividades de la vida diaria y su participación en su rol laboral.\',\n  \'sesiones_realizadas\' => \'10.00\',\n)','2017-02-10 14:55:58'),(1208,5,'186.144.76.191',1,'cliente_fisioterapia',1,'Insert cliente_fisioterapia data:array (\n  \'frecuencia_cardiaca_inicio\' => \'83.00\',\n  \'frecuencia_cardiaca_zona_aerobica\' => NULL,\n  \'frecuencia_respiratoria\' => \'20.00\',\n  \'montgomery_numero_repeticiones\' => \'10.00\',\n  \'montgomery_posicion\' => \'5\',\n  \'montgomery_tiempo\' => \'30.00\',\n  \'peso\' => \'74.90\',\n  \'porcentaje_grasa\' => \'18.00\',\n  \'porcentaje_musculo\' => \'38.70\',\n  \'puente_pronto\' => \'60.00\',\n  \'puente_pronto_clasificacion\' => \'bien\',\n  \'push_up\' => \'14.00\',\n  \'push_up_rango\' => \'excelente\',\n  \'recomendaciones\' => \'POSTURA: \r\nvista posterior: descenso hombro derecho. tibias varas. escoliosis dorsal izquierda.\r\nvista lateral: hiperlordosis lumbar. protrusion de hombros, protrusión abdominal. hiperextensión de rodillas.\r\nVista Anterior: aumento angulo torac