 y rotaciones de 0-30° con de hombro izquierdo todos con sensacion final vacio, presenta patrón  de movimiento malo para MSI. No se realizan pruebas especificas de hombro por presencia exacerbada de dolor. Todo lo anterior le limita sus actividades de la vida diaria, y le restringe su rol personal y recreativo.\',\n  \'evaluacion_final\' => \'A la revaloracion la paciente presenta dolor en cara postero-medial del hombro  izquierdo de 6/10 al movimiento de flexión y abd de hombro y a la palpación, presenta disminución de espasmos en fibras supraespinoso, romboideos y deltoides izquierdo, presenta aumento en el rango de movimiento para la flexión 0 -140°,abd 0-120° y rotaciones para la rotación interna de 0-60°, sigue presentando disminución para la rotación externa de 0-30° con sensación final vacío, presenta patrón  de movimiento malo para MSI. A la valoración muscular presenta contracciones débiles para todos los grupos musculares del hombro y contracciones fuertes para flexores y extensores de codo izquierdo.\r\nTodo lo anterior le sigue limitando sus actividades de la vida diaria, y le restringe su rol personal y recreativo.\',\n  \'sesiones_realizadas\' => \'5.00\',\n  \'id_representante\' => \'3\',\n)','2017-02-24 14:58:49'),(1970,5,'186.144.76.191',1,'cliente_sub_paquete',54,'Insert cliente_sub_paquete data:array (\n  \'fecha_pago\' => \'2017-02-24 18:10:30\',\n  \'fecha_limite\' => \'2017-03-23 00:00:00\',\n  \'id_sub_paquete\' => \'1\',\n  \'total_pagar\' => \'150000\',\n  \'id_cliente\' => \'6\',\n  \'descuento\' => \'0\',\n  \'fecha_inicio\' => \'2017-02-23\',\n)','2017-02-24 16:10:30'),(1971,5,'186.144.76.191',2,'sesion_sub_paquete',638,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-02-24\',\n  \'estado\' => 3,\n)','2017-02-24 16:11:27'),(1972,5,'186.144.76.191',2,'sesion_sub_paquete',856,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-02-24\',\n  \'estado\' => 3,\n)','2017-02-24 16:12:03'),(1973,5,