 sedativo.\r\nEjercicios de fortalecimiento muscular.\r\nEjercicios de estimulacion propioceptiva\r\nEstiramiento mantenido.\r\n\',\n  \'diagnostico\' => \'Esguince de cuello de pie izquierdo\',\n  \'fecha_evaluacion_inicial\' => \'2017-02-14\',\n  \'fecha_evaluacion_final\' => \'2017-02-03\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino, quien ingresa de manera independiente al servicio de fisioterapia. A la valoración el paciente presenta dolor de 5/10 al final del rango de inversión de cuello de pie izquierdo. presenta espasmos en tibial anterior bilateral y gastrocnemios bilateral. presenta edema a nivel de maléolo lateral izquierdo de 2cm respecto al derecho evaluado con perimetria. Presenta alteración de la propiocepcion y el balance en MII teniendo un apoyo unipodal de 10seg en superficie regular. No presenta disminución del rango de movimiento ni de la fuerza muscular. presenta patrones de movimiento buenos para MII y normales para MID. No presenta alteración en la funcionalidad pero si limita su rol deportivo.\',\n  \'evaluacion_final\' => \'A la revaloración el paciente presenta dolor de 2/10 al final del rango de inversión de cuello de pie izquierdo. Presenta disminución de espasmos en tibial anterior bilateral y gastrocnemios bilateral. No presenta edema en MMII ni signo de fovea . Presenta leve alteración de la propiocepcion y el balace en MII teniendo un apoyo unipodal de 30 seg en superficie inestable (bosu). No presenta disminución del rango de movimiento ni de la fuerza muscular. presenta patrones de movimiento buenos para MII y normales para MID. No presenta alteración en la funcionalidad ni limitacion en la participación de ninguno de sus roles.\',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'3\',\n)','2017-03-02 15:00:54'),(2288,6,'186.144.76.191',2,'cliente_historia_clinica',7,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'Crioterapia, masaje con hielo.\r\nTENS, nivel sensitivo.\r\nUltrasonido, pulsado nivel 6 durante 5 minutos.\r\nMasaje de drenaje y sedativo.\r\nEjercicios de fortalecimiento muscular.\r\nEjercicios de estimulacion propioceptiva\r\nEstiramiento mantenido.\r\n\',\n  \'diagnostico\' => \'Esguince de cuello de pie izquierdo\',\n  \'fecha_evaluacion_inicial\' => \'2017-02-14\',\n  \'fecha_evaluacion_final\' => \'2017-03-02\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino, quien ingresa de manera independiente al servicio de fisioterapia. A la valoración el paciente presenta dolor de 5/10 al final del rango de inversión de cuello de pie izquierdo. presenta espasmos en tibial anterior bilateral y gastrocnemios bilateral. presenta edema a nivel de maléolo lateral izquierdo de 2cm respecto al derecho evaluado con perimetria. Presenta alteración de la propiocepcion y el balance en MII teniendo un apoyo unipodal de 10seg en superficie regular. No presenta disminución del rango de movimiento ni de la fuerza muscular. presenta patrones de movimiento buenos para MII y normales para MID. No presenta alteración en la funcionalidad pero si limita su rol deportivo.\',\n  \'evaluacion_final\' => \'A la revaloración el paciente presenta dolor de 2/10 al final del rango de inversión de cuello de pie izquierdo. Presenta disminución de espasmos en tibial anterior bilateral y gastrocnemios bilateral. No presenta edema en MMII ni signo de fovea . Presenta leve alteración de la propiocepcion y el balace en MII teniendo un apoyo unipodal de 30 seg en superficie inestable (bosu). No presenta disminución del rango de movimiento ni de la fuerza muscular. presenta patrones de movimiento buenos para MII y normales para MID. No presenta alteración en la funcionalidad ni limitacion en la participación de ninguno de sus roles.\',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'3\',\n)','2017-03-02 15:01:28'),(2289,5,'186.144.76.191',2,'sesion_sub_paquete',849,'Update sesion_sub_paq