e_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'crioterapia, masaje con hielo.\r\nTermoterapia, paquete caliente.\r\nTENS, nivel sensitivo. \r\nUltrasonido Pulsado a 1mHz.\r\nmasaje sedativo.\r\ndeslizamiento neural\r\nEjercicios Isometricos\r\nTFNP, isometricas alternas y estabilizacion ritmica.\r\nejercicios de rango de movimiento activos y asistidos al final del rango.\r\nTracciones.\r\nEstiramiento mantenido\',\n  \'diagnostico\' => \'Dolor de hombro izquierdo.\',\n  \'fecha_evaluacion_inicial\' => \'2017-02-16\',\n  \'fecha_evaluacion_final\' => \'2017-02-03\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino en buenas condiciones quien ingresa al servicio de fisioterapia de manera independiente. A la evaluación fisioterapeutica presenta dolor en hombro derecho de 8/10 al movimiento de flexión y abd de hombro. presenta espasmos en musculo trapecio fibras superiores, romboides, pectoral mayor y deltoides derecho.Presenta retracciones en musculo pectoral mayor y menor bilateral y limitación de la movilidad articular de hombro derecho para la flexión y la abd de 0-160° con sensación final vacío. presenta patrones de movimientos buenos para MSD y normales para MSI. A la exploración de pruebas especificas de hombro presenta positivas hawkins y kennedy, neer, speed, arco doloroso, yegarson, jobe y yocum. lo anterior limita sus actividades de la vida diaria y su participación en su rol laboral.\',\n  \'evaluacion_final\' => \'A la revaloración no presenta disminución de dolor en hombro derecho al movimiento de flexión y abd de hombro. Presenta disminución de espasmos en musculo trapecio fibras superiores, romboides, pectoral mayor derecho y aun presenta en deltoides derecho. Presenta disminución de retracciones en pectorales y aun presenta limitación de movilidad articular de hombro derecho para la flexión y la abd de 0-160° con sensación final vacío. presenta patrones de movimientos buenos para MSD. A la 