 sedativo en miembros inferiores y masaje de drenaje en miembro inferior derecho.\r\n\r\n-Tens nivel sensitivo en miembro inferior derecho.\r\n\r\n- Termoterapia, paquete caliente en miembro inferior izquierdo.\r\n\r\n- Ejercicios de cadena cinética cerrada con balón terapéutico.\r\n\r\n- Ejercicios activo-asistidos en diagonales de movimiento.\r\n\r\n-Entrenamiento funcional, reeducacion de la marcha en tres puntos.\r\n\r\n-Ultrasonido pulsado, de 1HZ, durante 7 minutos en rodilla derecha.\r\n\r\n- Trabajo de reducacion de la marcha en banda sin fin y superficie irregular como colchoneta.\r\n\r\n-Ejercicios de fortalecimiento del core.\r\n\r\n-Trabajo en bicicleta estática.\r\n\r\n-Ejercicios de coordinación y balance alcances anteriores con cono y balón.\r\n\r\n-Ejercicios de fortalecimiento con resistencia externa, multifuerza y sentadillas con balón.\r\n\r\n-Trabajo de balance y propiocepcion en superficie inestable (bosu)\r\n\r\n-Trabajo con TRX.\',\n  \'diagnostico\' => \'Fractura de menisco y Artroscopia derecha de 7 semanas de evolución\',\n  \'fecha_evaluacion_inicial\' => \'2017-02-01\',\n  \'fecha_evaluacion_final\' => \'2017-03-21\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino, de 50 años de edad con diagnostico medico de fractura de menisco derecho y artroscopia. Ingresa al servicio de fisioterapia realizando marcha de tres puntos de manera inadecuada. presenta dolor en rodilla derecha de 7/10 al reposo y al movimiento de flexión y extensión de rodilla. Presenta edema de 4cm en rodilla respecto al otro miembro y espasmos musculares en cuadriceps femoral, tibial anterior y peroneos bilateral. presenta disminución del rango de movimiento para la flexion de rodilla derecha de 0-90° y  alteración de los patrones de movimiento para miembro inferior derecho siendo malos por restricción en las descargas de peso. Lo anterior la limita en las actividades de la vida diaria y su participación en su rol laboral.\',\n  \'evaluacion_final\' => \'A la revaloración terapéutica después de 32 sesiones de fisioterapia la paciente realiza marcha de forma independiente con todas las fases, subfases y determinantes de la marcha. Presenta dolor en rodilla derecha de 2/10 al reposo y al movimiento de flexión y extensión de rodilla. No presenta edema, pero si espasmos en aductores de cadera bilateral. No hay disminución del rango de movimiento en rodilla y  no hay alteración de los patrones de movimiento,  pero presenta alteración de la propiocepcion y el balance teniendo un apoyo unipodal en superficie inestable (bosu) para miembro inferior derecho de 12s y de 17s para el miembro inferior izquierdo. Lo anterior no le produce alteración de la funcionalidad, ni restricción en ninguno de sus roles.\',\n  \'sesiones_realizadas\' => \'32.00\',\n  \'id_representante\' => \'3\',\n)','2017-03-21 14:18:05'),(2848,6,'190.9.206.78',2,'cliente_historia_clinica',2,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Helio David Rueda Cadena\',\n  \'plan_tratamiento\' => \'- Crioterapia, masaje con hielo en zona de edema.\r\n\r\n-Masaje sedativo en miembros inferiores y masaje de drenaje en miembro inferior derecho.\r\n\r\n-Tens nivel sensitivo en miembro inferior derecho.\r\n\r\n- Termoterapia, paquete caliente en miembro inferior izquierdo.\r\n\r\n- Ejercicios de cadena cinética cerrada con balón terapéutico.\r\n\r\n- Ejercicios activo-asistidos en diagonales de movimiento.\r\n\r\n-Entrenamiento funcional, reeducacion de la marcha en tres puntos.\r\n\r\n-Ultrasonido pulsado, de 1HZ, durante 7 minutos en rodilla derecha.\r\n\r\n- Trabajo de reducacion de la marcha en banda sin fin y superficie irregular como colchoneta.\r\n\r\n-Ejercicios de fortalecimiento del core.\r\n\r\n-Trabajo en bicicleta estática.\r\n\r\n-Ejercicios de coordinación y balance alcances anteriores con cono y balón.\r\n\r\n-Ejercicios de fortalecimiento con resistencia externa, multifuerza y sentadillas con balón.\r\n\r\n-Trabajo de balance y 