/10 a la palpación y de 5/10 al reposo. Se palpan espasmos en tibial anterior derecho y gastrocnemios bilateral, se evidencia edema en maleolo derecho respecto al izquierdo,  la movilidad articular en cuello de pie e encuentra conservada. Presenta patrones de movimientos buenos para miembro inferior derecho y normales para miembro inferior izquierdo, se observa alteración de la propiocepcion y el balance teniendo en apoyo unipodal derecho 18seg e izquierdo 26seg.  Lo anterior no limita su funcionalidad pero si restringe su participacion en su rol deportivo.\',\n  \'evaluacion_final\' => \'A la revaloracion la paciente presenta dolor en maleolo externo de 3/10 al movimiento de inversión del pie, de 4/10 a la palpación y de 0/10 al reposo. Se disminuyeron espasmos en tibial anterior derecho y persisten en gastrocnemios bilateral, no se evidencia  edema en maleolo derecho y se observa mejora en la propiocepcion y el balance teniendo en apoyo unipodal derecho 41seg e izquierdo 50seg. Demás evaluaciones se encuentran iguales y no se encuentra limitada su funcionalidad pero si restringe su participacion en su rol deportivo.\',\n  \'sesiones_realizadas\' => \'5.00\',\n  \'id_representante\' => \'2\',\n)','2017-03-27 16:32:12'),(3030,5,'186.144.76.191',2,'sesion_sub_paquete',919,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-03-28\',\n  \'estado\' => 3,\n)','2017-03-28 05:30:36'),(3031,5,'186.144.76.191',2,'sesion_sub_paquete',1033,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-03-28\',\n  \'estado\' => 3,\n)','2017-03-28 05:30:48'),(3032,5,'186.144.76.191',2,'sesion_sub_paquete',662,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-03-28\',\n  \'estado\' => 3,\n)','2017-03-28 05:30:58'),(3033,5,'186.144.76.191',2,'cliente_sub_paquete',44,'Update cliente_sub_paquete data:array (\n  \'estado\' => 2,\n  \'fecha_modificacion\' => \'2017-03-28\',\n)','2017-03-28 05:30:58'),(3034,5,'186.144.76.19