data:array (\n  \'id_representante\' => \'2\',\n  \'fecha_hora_inicio\' => \'2017-07-28 08:00:00\',\n  \'fecha_hora_fin\' => \'2017-07-28 09:00:00\',\n  \'fecha_modificacion\' => \'2017-07-27\',\n  \'estado\' => 1,\n)','2017-07-27 06:05:40'),(6011,5,'186.87.216.153',2,'cliente_historia_clinica',26,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'Modalidades físicas  (crimasaje, paquetes calientes), masaje terapéutico, ejercicios isométricos, Técnicas de Facilitación Neuromuscular Propioceptivas , ejercicios de fortalecimiento con pesas y balón medicinal de hasta 3 libras, ejercicios de Codman, fortalecimiento de cintura escapular en multifuerza.\',\n  \'diagnostico\' => \'Dolor de hombro Izquierdo.\',\n  \'fecha_evaluacion_inicial\' => \'1969-12-31\',\n  \'fecha_evaluacion_final\' => \'2017-07-24\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino de 84 años de edad con impresiòn diagnóstica de tendinitis de manguito rotador izquierdo. Presenta dolor de 8/10 en la EAV en zona deltoidea al reposo (matutino) y al realizar cualquier movimiento por encima de su cabeza. Espasmos moderados en Trapecio fibras superiores, elevador de la escapula y supraespinoso. Flexión de hombro izquierdo de 130°, extensión 30°, abd 90°, rotación interna 30° (muy dolorosa) y rotación externa 40°. Patrones de movimiento regulares para miembro superior izquierdo con mayor compromiso del componente rotatorio. Hay alteración en todas sus actividades d la vida diaria y básicas cotidianas donde involucre el miembro superior izquierdo.\',\n  \'evaluacion_final\' => \'Paciente que finaliza sus 10 sesiones de fisioterapia. Escala análoga de dolor de 2/10 matutino al reposo en deltoides fibras medias, sin espasmos musculares en trapecio fibras superiores, elevador de la escapula y supraespinoso, flexión de hombro 130°, extensión de 30°, abducción 100° con sensación final firme, con aumento de la fuerza muscular y patrones de movimiento buenos. Mejoró en sus actividades de la vida diaria ( vestirse, peinarse, bañarse y dormir) y sus actividades básicas cotidianas ( como llevar peso de hasta 3 libras del supermercado a la casa). \',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'5\',\n)','2017-07-27 06:34:29'),(6012,5,'186.87.216.153',2,'cliente_historia_clinica',25,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'medios de contraste (criomasaje, paquetes calientes), ultrasonido pulsatil, TENS modalidad normal para alivio de dolor, TFNP sostener -relajar, contracciones repetidas, fortalecimiento muscular general de bajo impacto y trabajo de propiocepción utilizando TRX, bosu, trampolín, escalerilla de agilidad.\r\nReeducación de marcha en caminadora.\',\n  \'diagnostico\' => \'Fractura metatarsianos y cuñas pie derecho\',\n  \'fecha_evaluacion_inicial\' => \'2017-07-04\',\n  \'fecha_evaluacion_final\' => \'2017-07-26\',\n  \'evaluacion_inicial\' => \'Recibo paciente de 30 años quien sufre caída de una altura de 1 metro, de 8 meses de evolución,  y como resultado luxofractura metatarsiana y de cuñas de pie derecho.\r\nPresenta: dolor 7/10 al caminar o permanecer largo tiempo de pie ubicado en cuello de pie, zona dorsal de antepie y fascia platar.\r\narcos movilidad; dorsiflexión 15°, platiflexión 40°, inversión 40°, eversión 30°, flexión de dedos disminuida.\r\nFuerza muscular disminuida en 3+ para musculatura flexora de los dedos, plantiflexores y evertores de pie derecho.\r\nCircunferencia del pie comparativa: edema de 1.5 cm en antepie derecho, 2.5 cm zona medial del pie y 1 cm a nivel de tobillo.\r\nrealiza marha antálgica con alteración en la fase de apoyo plantar y despegue de los dedos.\r\nTiene pies cavos con mayor compromiso del derecho.\r\nAlteración para realizar todas las actividades de la vida diaria que impliquen marchas de mediana y larga distancia y realizar elevación en los pedales al montar bicicleta.\',\n  \'evaluacion_final\' => \'Finalizadas 15 sesiones de fisioterapia se encuentra: disminución de dolor a 6/10 en la EAV y solo aparece en zona dorsal de antepie al realizar los primeros pasos de la mañana o al pasar de sedente por largo tiempo a posición de pie. Arcos de movilidad normales comparados con el pie izquierdo. No hay edema pero si una circunferencia aumentada en 1.5 cm en zona del mediopie derecho comparada con el izquierdo que hace que dicho pie se vea más cavo. La fuerza muscular ya se encuentra normal. Mejoró la propiocepción y el patrón de marcha aunque al acelerar el paso se aprecia disminución aun en la fase de despegue de los dedos.\r\nMejoró su funcionalidad para realizar caminatas y su actividad deportiva (ciclismo).\',\n  \'sesiones_realizadas\' => \'15.00\',\n  \'id_representante\' => \'2\',\n)','2017-07-27 07:02:05'),(6013,5,'186.87.216.153',2,'sesion_sub_paquete',2727,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'4\',\n  \'fecha_hora_inicio\' => \'2017-08-10 10:00:00\',\n  \'fecha_hora_fin\' => \'2017-08-10 11:00:00\',\n  \'fecha_modificacion\' => \'2017-07-27\',\n  \'estado\' => 1,\n)','2017-07-27 07:11:16'),(6014,5,'186.87.216.153',2,'cliente_historia_clinica',26,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'Modalidades físicas  (crimasaje, paquetes calientes), masaje terapéutico, ejercicios isométricos, Técnicas de Facilitación Neuromuscular Propioceptivas , ejercicios de fortalecimiento con pesas y balón medicinal de hasta 3 libras, ejercicios de Codman, fortalecimiento de cintura escapular en multifuerza.\',\n  \'diagnostico\' => \'Dolor de hombro Izquierdo.\',\n  \'fecha_evaluacion_inicial\' => \'2017-07-10\',\n  \'fecha_evaluacion_final\' => \'2017-07-24\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino de 84 años de edad con impresiòn diagnóstica de tendinitis de manguito rotador izquierdo. Presen