 lumbares, 8/10 porción medial del  glúteo mayor, 8/10 a la presión en la porción medial de glúteo mayor y de 6/10 al movimiento de flexión de tronco en zona lumbar que se irradia hasta el agujero popliteo derecho, espasmos en musculatura paravertebral dorso lumbar y glúteo mayor derecho, patrones de movimientos regulares por disminución de la fuerza muscular, prueba de flexibilidad Sit  and Reach  modificada mala de -15cm, con marcha antalgica, dificultándole sus actividades de la vida diaria (caminar).\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'5\',\n)','2017-07-31 19:54:52'),(6025,65,'181.174.45.220',1,'cliente_historia_clinica',28,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla \',\n  \'plan_tratamiento\' => \'Criomasaje: Masaje cubo de hielo\r\nUltrasonido, pulsátil y continuo\r\nTENS, \r\nTermoterapia: Paquete caliente \r\nMasaje de drenaje y sedación \r\nEntrenamiento de marcha sobre colchoneta , banda sin fin, \r\nEntrenamiento funcional para equilibrio bosú\r\nEntrenamiento con TRX. \r\n\',\n  \'diagnostico\' => \'Tendinitis aquiliana y acortamiento del tendón \',\n  \'fecha_evaluacion_inicial\' => \'2017-07-19\',\n  \'fecha_evaluacion_final\' => \'2017-08-14\',\n  \'evaluacion_inicial\' => \'Paciente masculino triatlonista de 28 años de edad, quien llega al consultorio refiriendo dolor moderado en zona posterosuperior del calcáneo del pie izquierda al inicio de la fase de despegue de dedos al trotar, hace 15 días de evolución, a valoración refiere dolor de 6/10 a palpación en la superficie posterosuperior calcáneo, 6/10 al inicio del movimiento activo de la plantiflexión, presenta edema leve y prominencia anormal en la superficie  posterosuperior calcáneo  y se corrobora con perimetría registrando 0,5cm comparativamente al pie derecho, retracciones leves para musculatura de zona lumbar, isquiotibiales y gastrosoleos bilateralmente, completa arcos al movimiento pasivo en platiflexión, dorsiflexión, eversión e inversión de pie izquierdo,  buena fuerza muscular en plantiflexores, dorsiflexores,  evertores e invertores. En Postura vista anterior  presenta tibias en valgo , descenso del arco plantar en apoyo en pie izquierdo, postura en vista lateral presenta hiperextesión en rodillas  marcha normal, buena coordinación y  regular propiocepción en miembros inferiores, registrando 30 segundos en equilibrio unipodal con dificultad para mantener dicha postura.  lo anterior no limita su funcionalidad en actividades de desplazamiento y no restringe su participación en su rol laboral, pero si en su rol de deportista\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'12.00\',\n  \'id_representante\' => \'4\',\n  \'fecha_registro\' => \'2017-07-31 23:02:56\',\n  \'id_cliente\' => \'78\',\n)','2017-07-31 21:02:57'),(6026,65,'181.174.45.220',1,'cliente_historia_clinica',29,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Jhon Freddy Fonseca\',\n  \'plan_tratamiento\' => \'Crioterapia, masaje con hielo.\r\nMasaje sedativo y de drenaje.\r\nEjercicios de rango de movimiento asistidos para flexión, extensión y abducción de cadera.\r\nEjercicios de rango de movimiento activos y resistidos para cuadriceps e isquiotibiales.\r\nentrenamiento de marcha con caminador y bastón \r\nse dan recomendaciones para conservación y limitación de movimientos antiluxantes \',\n  \'diagnostico\' => \'Remplazo cadera izquierda\',\n  \'fecha_evaluacion_inicial\' => \'2017-07-28\',\n  \'fecha_evaluacion_final\' => \'2017-08-08\',\n  \'evaluacion_inicial\' => \'Paciente masculino de 67 años de edad, a quien se le realizará las terapias físicas en su domicilio, por presentar cirugía de remplazo de cadera izquierda hace 4 días de evolución, el se encuentra acompañado de su esposa. A valoración no refiere dolor al reposo, 7/10 a palpación en zona lumbar y sacro iliaca, y 4/10 al movimiento pasivo de flexión de cadera con rodilla extendida, flexión de cadera con rodilla flexionada, abducción y extensión de cadera izquierda. a inspección presenta apósito en glúteo medio, sin hematomas, pero con edema moderado hasta mitad de muslo izquierdo , se corrobora con perimetría registrando 1,5 cm comparativamente con muslo derecho, atrofia muscular de miembro inferior izquierdo, disminución de rangos de movilidad pasiva con sensación final firme por retracciones y compensaciones a la flexión de cadera con rodilla de extendida de 0- 70°, flexión de cadera con rodilla flexionada de 0- 90°, abducción de 0- 30°, extensión de cadera 0- 5°,mala fuerza muscular para patrones de movimiento de miembro inferior izquierdo. marcha con caminador mal adaptado con 6 puntos de apoyo. lo anterior limita su funcionalidad en actividades de desplazamiento y restringe su participación en su rol laboral y recreativo\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'5.00\',\n  \'id_representante\' => \'4\',\n  \'fecha_registro\' => \'2017-07-31 23:33:40\',\n  \'id_cliente\' => \'53\',\n)','2017-07-31 21:33:40'),(6027,65,'186.87.216.153',1,'cliente_fisioterapia',45,'Insert cliente_fisioterapia data:array (\n  \'frecuencia_cardiaca_inicio\' => \'63\',\n  \'frecuencia_cardiaca_zona_aerobica\' => \'102 - 119\',\n  \'frecuencia_respiratoria\' => \'24\',\n  \'montgomery_numero_repeticiones\' => \'10\',\n  \'montgomery_posicion\' => \'3\',\n  \'montgomery_tiempo\' => \'30\',\n  \'peso\' => \'70\',\n  \'porcentaje_grasa\' => \'42\',\n  \'porcentaje_musculo\' => \'26.9\',\n  \'puente_pronto\' => \'15\',\n  \'puente_pronto_clasificacion\' => \'malo\',\n  \'push_up\' => \'1\',\n  \'push_up_rango\' => \'malo\',\n  \'recomendaciones\' => NULL,\n  \'seat_reach\' => \'-14\',\n  \'seat_reach_clasificacion\' => \'moderadas retracciones de musculatura posterior de miembros inferiores y zona lumbar\',\n  \'talla\' => \'1.63\',\n  \'tecumseh\' => \'34\',\n  \'fecha_registro\' => \'2017-07-31\',\n  \'tecumseh_cla