ior del calcáneo del pie izquierda al inicio de la fase de despegue de dedos al trotar, hace 15 días de evolución, a valoración refiere dolor de 6/10 a palpación en la superficie posterosuperior calcáneo, 6/10 al inicio del movimiento activo de la plantiflexión, presenta edema leve y prominencia anormal en la superficie  posterosuperior calcáneo  y se corrobora con perimetría registrando 0,5cm comparativamente al pie derecho, retracciones leves para musculatura de zona lumbar, isquiotibiales y gastrosoleos bilateralmente, completa arcos al movimiento pasivo en platiflexión, dorsiflexión, eversión e inversión de pie izquierdo,  buena fuerza muscular en plantiflexores, dorsiflexores,  evertores e invertores. En Postura vista posterior  presenta tibias en valgo , descenso del arco plantar en apoyo en pie izquierdo, postura en vista lateral presenta hiperextesión en rodillas  marcha normal, buena coordinación y  regular propiocepción en miembros inferiores, registrando 30 segundos en equilibrio unipodal con dificultad para mantener dicha postura.  lo anterior no limita su funcionalidad en actividades de desplazamiento y no restringe su participación en su rol laboral, pero si en su rol de deportista\',\n  \'evaluacion_final\' => \'a valoración final se nota mejoría al no referir dolor a ningun  movimiento pasivo y/o activo de tobillo izquierdo, ni a la palpación en la superficie posterosuperior calcáneo,  persiste prominencia anormal en la superficie  posterosuperior calcáneo, disminuyo edema en zona articular astragalocalcanea, retracciones leves para musculatura de zona lumbar, isquiotibiales y gastrosoleos bilateralmente, completa arcos al movimiento pasivo en platiflexión, dorsiflexión, eversión e inversión de pie izquierdo,  buena fuerza muscular en plantiflexores, dorsiflexores,  evertores e invertores. En Postura vista posterior  presenta tibias en valgo , descenso del arco plantar en apoyo en pie izquierdo, postura en vista lateral presenta hiperextesión en rodillas  marcha normal, buena coordinación y  buena propiocepción en miembros inferiores, registrando 60 segundos en equilibrio unipodal  manteniendo dicha postura.  lo anterior no limita su funcionalidad en actividades de desplazamiento y no restringe su participación en su rol laboral.\',\n  \'sesiones_realizadas\' => \'12.00\',\n  \'id_representante\' => \'4\',\n)','2017-08-22 04:31:50'),(6778,5,'186.87.216.153',2,'sesion_sub_paquete',2791,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-08-23\',\n  \'estado\' => 3,\n)','2017-08-23 04:49:34'),(6779,5,'186.87.216.153',2,'sesion_sub_paquete',3166,'Update sesion_sub_paquete data:array (\n  \'estado\' => 2,\n  \'fecha_hora_inicio\' => \'(NULl)\',\n  \'fecha_hora_fin\' => \'(NULl)\',\n)','2017-08-24 09:03:06'),(6780,5,'186.87.216.153',2,'cliente_sub_paquete',247,'Update cliente_sub_paquete data:array (\n  \'numero_excusas\' => 1,\n)','2017-08-24 09:03:06'),(6781,5,'186.87.216.153',2,'sesion_sub_paquete',3166,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'2\',\n  \'fecha_hora_inicio\' => \'2017-09-12 10:00:00\',\n  \'fecha_hora_fin\' => \'2017-09-12 11:00:00\',\n  \'fecha_modificacion\' => \'2017-08-24\',\n  \'estado\' => 1,\n)','2017-08-24 09:03:49'),(6782,5,'186.87.216.153',2,'sesion_sub_paquete',3167,'Update sesion_sub_paquete data:array (\n  \'numero\' => 4,\n)','2017-08-24 09:03:49'),(6783,5,'186.87.216.153',2,'sesion_sub_paquete',3168,'Update sesion_sub_paquete data:array (\n  \'numero\' => 5,\n)','2017-08-24 09:03:49'),(6784,5,'186.87.216.153',2,'sesion_sub_paquete',3169,'Update sesion_sub_paquete data:array (\n  \'numero\' => 6,\n)','2017-08-24 09:03:49'),(6785,5,'186.87.216.153',2,'sesion_sub_paquete',3170,'Update sesion_sub_paquete data:array (\n  \'numero\' => 7,\n)','2017-08-24 09:03:49'),(6786,5,'186.87.216.153',2,'sesion_sub_paquete',3166,'Update sesion_sub_paquete data:array (\n  \'numero\' => 8,\n)','2017-08-24 09:03:49'),(6787,5,'186.87.216.153',1,'persona'