n Camilo Mantilla\',\n  \'plan_tratamiento\' => \'- Crioterapia, masaje con hielo durante 5 minutos.\r\n-Tens, nivel sensitivo.\r\n-Masaje de drenaje y sedativo.\r\n-Ejercicios de fortalecimiento con resistencia externa y manual.\r\n-Ejercicios de propiocepcion y balance en colchoneta y bosu.\r\n-Alcances anteriores con balon y cono.\r\n-Ejercicios en Trx.\r\n-Marcha en punta de pies y sobre talones en superficie inestable (colchoneta).\r\n-Sentadillas con Balon de bobath.\r\n-Fortalecimientos de evertores con balón de peso\r\n\',\n  \'diagnostico\' => \'Inestabilidad de tobillo derecho por esguince antiguo\',\n  \'fecha_evaluacion_inicial\' => \'2017-03-21\',\n  \'fecha_evaluacion_final\' => \'2017-03-27\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino que ingresa al servicio de fisioterapia realizando marcha de manera independiente. A la valoración fisioterapeutica presenta dolor en maleolo externo de 7/10 al movimiento de inversión del pie, de 7/10 a la palpación y de 5/10 al reposo. Se palpan espasmos en tibial anterior derecho y gastrocnemios bilateral, se evidencia edema en maleolo derecho respecto al izquierdo,  la movilidad articular en cuello de pie e encuentra conservada. Presenta patrones de movimientos buenos para miembro inferior derecho y normales para miembro inferior izquierdo, se observa alteración de la propiocepcion y el balance teniendo en apoyo unipodal derecho 18seg e izquierdo 26seg.  Lo anterior no limita su funcionalidad pero si restringe su participacion en su rol deportivo.\',\n  \'evaluacion_final\' => \'A la revaloracion la paciente presenta dolor en maleolo externo de 3/10 al movimiento de inversión del pie, de 4/10 a la palpación y de 0/10 al reposo. Se disminuyeron espasmos en tibial anterior derecho y persisten en gastrocnemios bilateral, no se evidencia  edema en maleolo derecho y se observa mejora en la propiocepcion y el balance teniendo en apoyo unipodal derecho 41seg e izquierdo 50seg. Demás evaluaciones se encuentran iguales y no se encuentra limitada su funcionalidad pero si restringe su participacion en su rol deportivo.\',\n  \'sesiones_realizadas\' => \'5.00\',\n  \'id_representante\' => \'6\',\n)','2017-08-28 18:46:53'),(6822,1,'181.56.221.61',2,'cliente_historia_clinica',11,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'- Crioterapia, masaje con hielo durante 5 minutos.\r\n-Tens, nivel sensitivo.\r\n-Masaje de drenaje y sedativo.\r\n-Ejercicios de fortalecimiento con resistencia externa y manual.\r\n-Ejercicios de propiocepcion y balance en colchoneta y bosu.\r\n-Alcances anteriores con balon y cono.\r\n-Ejercicios en Trx.\r\n-Marcha en punta de pies y sobre talones en superficie inestable (colchoneta).\r\n-Sentadillas con Balon de bobath.\r\n-Fortalecimientos de evertores con balón de peso\r\n\',\n  \'diagnostico\' => \'Inestabilidad de tobillo derecho por esguince antiguo\',\n  \'fecha_evaluacion_inicial\' => \'2017-03-21\',\n  \'fecha_evaluacion_final\' => \'2017-03-27\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino que ingresa al servicio de fisioterapia realizando marcha de manera independiente. A la valoración fisioterapeutica presenta dolor en maleolo externo de 7/10 al movimiento de inversión del pie, de 7/10 a la palpación y de 5/10 al reposo. Se palpan espasmos en tibial anterior derecho y gastrocnemios bilateral, se evidencia edema en maleolo derecho respecto al izquierdo,  la movilidad articular en cuello de pie e encuentra conservada. Presenta patrones de movimientos buenos para miembro inferior derecho y normales para miembro inferior izquierdo, se observa alteración de la propiocepcion y el balance teniendo en apoyo unipodal derecho 18seg e izquierdo 26seg.  Lo anterior no limita su funcionalidad pero si restringe su participacion en su rol deportivo.\',\n  \'evaluacion_final\' => \'A la revaloracion la paciente presenta dolor en maleolo externo de 3/10 al movimiento de inversión del pie, de 4/10 a la palpación y de 0/10 al reposo. Se disminuyeron espasmos en tibial anterior derecho y persisten en gastrocnemios bilateral, no se evidencia  edema en maleolo derecho y se observa mejora en la propiocepcion y el balance teniendo en apoyo unipodal derecho 41seg e izquierdo 50seg. Demás evaluaciones se encuentran iguales y no se encuentra limitada su funcionalidad pero si restringe su participacion en su rol deportivo.\',\n  \'sesiones_realizadas\' => \'5.00\',\n  \'id_representante\' => \'2\',\n)','2017-08-28 18:47:37'),(6823,5,'186.87.216.153',1,'cliente_sub_paquete',252,'Insert cliente_sub_paquete data:array (\n  \'fecha_limite\' => \'2017-09-22 00:00:00\',\n  \'id_sub_paquete\' => \'2\',\n  \'total_pagar\' => \'200000\',\n  \'id_cliente\' => \'78\',\n  \'descuento\' => \'0\',\n  \'fecha_inicio\' => \'2017-08-22\',\n  \'fecha_pago\' => \'2017-08-25\',\n)','2017-08-30 04:59:45'),(6824,5,'186.87.216.153',1,'sesion_sub_paquete',3206,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'252\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-08-30\',\n  \'numero\' => 1,\n)','2017-08-30 04:59:45'),(6825,5,'186.87.216.153',1,'sesion_sub_paquete',3207,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'252\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-08-30\',\n  \'numero\' => 2,\n)','2017-08-30 04:59:45'),(6826,5,'186.87.216.153',1,'sesion_sub_paquete',3208,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'252\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-08-30\',\n  \'numero\' => 3,\n)','2017-08-30 04:59:45'),(6827,5,'186.87.216.153',1,'sesion_sub_paquete',3209,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'252\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-08-30\',\n  \'numero\' => 4,\n)','2017-08-30 04:59:45'),(6828,5,'186.87.216.153',1,'sesion_sub_paquete',3210,'Insert sesion_sub_paquete data:array (\n  \