os isometricos. ejercicios de propiocepción y equilibrio en colchoneta.\',\n  \'diagnostico\' => \'Neuroma de  Morthon pie izquierdo \',\n  \'fecha_evaluacion_inicial\' => \'2017-09-21\',\n  \'fecha_evaluacion_final\' => \'2017-09-27\',\n  \'evaluacion_inicial\' => \'Paciente de 47 años de edad, con diagnostico médico mencionado, que ingresa al servicio de fisioterapia, refiriendo  parestesia en el 3, y 4 dedo de la  cara dorsal del pie izquierdo desencadenado por el uso del calzado, Zonas de hiperqueratosis plantar en talón  y base de la cabeza del primer y quinto metatarso, con dolor de 10/10 al movimiento activo según escala análoga del dolor,  induración de la fascia plantar bilateral, dorsiflexión  de  80° pie derecho y 70° pie izquierdo, plantiflexión de 20° bilateral, inversión de 30° bilateral, eversión de 20° en pie derecho y de 10° en pie izquierdo, al movimiento pasivo, con sensación final firme,espasmos musculares en gastrocnemios bilateral, Fuerza de 5/5 en todos los grupos musculares..\r\n Impidiéndole sus actividades de la vida diaria (caminar). \',\n  \'evaluacion_final\' => \'Paciente que finaliza sus 5 sesiones de fisioterapia, refiere disminución del dolor de 1/10 al movimiento activo según escala análoga del dolor, disminución de espasmos musculares en gastrocnemios bilaterales, mejora en las actividades de la vida diaria (caminar). Se le recomienda no utilizar zapato que termine en punta.\',\n  \'sesiones_realizadas\' => \'5.00\',\n  \'id_representante\' => \'5\',\n)','2017-10-11 09:09:08'),(8051,66,'186.114.231.144',1,'cliente_historia_clinica',34,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'particular\',\n  \'plan_tratamiento\' => \'Modalidades físicas (paquete caliente, TENS, ultrasonido), masaje, ejercicios isometricos , estiramientos de los miembros superiores.\',\n  \'diagnostico\' => \'Tendinitis del tendón largo del  bíceps \',\n  \'fecha_evaluacion_inicial\' => \'2017-10-09\',\n  \'fecha_evaluacion_final\' => \'1969-12-31\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino de 84 años de edad con diagnóstica de tendinitis del tendón largo del bíceps izquierdo. Presenta dolor de 6/10 en la EAV  al reposo (matutino) y 3/10 a los  movimiento por encima de su cabeza. Espasmos leves en Trapecio fibras superiores, supraespinoso, deltoides fibras medias e inflamación sobre el tendón de la cabeza larga del biceps .Flexión de hombro izquierdo de 130°, extensión 30°, abd 90°, rotación interna 30° y rotación externa 40°. Patrones de movimiento regulares para miembro superior izquierdo con mayor compromiso del componente rotatorio. Hay alteración en todas sus actividades de la vida diaria y básicas cotidianas donde involucre el miembro superior izquierdo (cargar paquetes ).\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'5\',\n  \'fecha_registro\' => \'2017-10-11 11:35:08\',\n  \'id_cliente\' => \'74\',\n)','2017-10-11 09:35:08'),(8052,66,'186.114.231.144',2,'cliente_historia_clinica',30,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular \',\n  \'plan_tratamiento\' => \'Paquete caliente, masaje terapéutico,  bicicleta recumbent, ejercicios isometricos, ejercicios en cadena cinética cerrada, ejercicios de propiocepción y descargas de peso.\',\n  \'diagnostico\' => \'Fractura de diáficis  de fémur derecho \',\n  \'fecha_evaluacion_inicial\' => \'2017-08-08\',\n  \'fecha_evaluacion_final\' => \'2017-10-11\',\n  \'evaluacion_inicial\' => \'Paciente de 13 años de edad, genero masculino con diagnostico ya mencionado, de 3 meses de evolución, ingresa en compañía de su madre con marcha apoyada en caminador, con disminución de la masa muscular  con circunferencia del muslo derecho  41cm a 10cm de la patela (5cm de déficit  respecto a contralateral) y de 50cm a 20cm de la patela ( 3cm déficit  respecto a contralateral), arcos de movilidad de flexión de cadera con rodilla flexionada 120° bilateral, flexión de cadera con rodilla extendida de 60° bilateral con sensación final fuerte, abducción 35° pierna derecha 40°  en pierna izquierda, con patrones de movimiento regulares, sin edema, sin dolor.\',\n  \'evaluacion_final\' => \'Paciente que no finaliza sus cesiones de fisioterapia y no se le puede realizar  la valoración final.\',\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'5\',\n)','2017-10-11 10:39:26'),(8053,66,'186.114.231.144',2,'cliente_historia_clinica',30,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular \',\n  \'plan_tratamiento\' => \'Paquete caliente, masaje terapéutico,  bicicleta recumbent, ejercicios isometricos, ejercicios en cadena cinética cerrada, ejercicios de propiocepción y descargas de peso.\',\n  \'diagnostico\' => \'Fractura de diáficis  de fémur derecho \',\n  \'fecha_evaluacion_inicial\' => \'2017-08-08\',\n  \'fecha_evaluacion_final\' => \'2017-08-25\',\n  \'evaluacion_inicial\' => \'Paciente de 13 años de edad, genero masculino con diagnostico ya mencionado, de 3 meses de evolución, ingresa en compañía de su madre con marcha apoyada en caminador, con disminución de la masa muscular  con circunferencia del muslo derecho  41cm a 10cm de la patela (5cm de déficit  respecto a contralateral) y de 50cm a 20cm de la patela ( 3cm déficit  respecto a contralateral), arcos de movilidad de flexión de cadera con rodilla flexionada 120° bilateral, flexión de cadera con rodilla extendida de 60° bilateral con sensación final fuerte, abducción 35° pierna derecha 40°  en pierna izquierda, con patrones de movimiento regulares, sin edema, sin dolor.\',\n  \'evaluacion_final\' => \'Paciente que no finaliza sus cesiones de fisioterapia y no se le puede realizar  la valoración final.\',\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'5\',\n)','2017-10-11 10:40:14'),(8054,5,'186.87.216.153',2,'cliente_historia_clinica',13,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Crioterapia. Masaje con hielo durante 10 minutos.\r\nTermoterapia, paquete caliente durante 10 minutos\r\nTens, nivel sensitivo. durante 10 minutos.\r\nMasaje de drenaje y sedativo. \r\nsostener relajar para isquiotibiales y recto anterior del cuadriceps.\r\nEstiramiento mantenido para gastrocnemios y musculatura plantar.\r\nRecomendaciones verbales sobre la importancia del reposo y pausa en sus actividades deportivas.\r\n\',\n  \'diagnostico\' => \'Espondilitis calcanea derecha.\',\n  \'fecha_evaluacion_inicial\' => \'2017-03-31\',\n  \'fecha_evaluacion_final\' => \'2017-04-26\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino que ingresa al servicio de fisioterapia de manera independiente realizando marcha antalgica. A la evaluación fisioterapeutica presenta dolor en talón y planta del pie derecho de 1/10 al reposo, de 4/10 a la palpación y de 6/10 movimiento de plantiflexión y dorsiflexión. Se palpan espasmos en musculo tibial anterior derecho y  gastrocnemio de forma bilateral ademas de edema de 1,2 cm de diferencia en talón derecho respecto al talón izquierdo. No se observa disminución del rango de movimiento, sin embargo presenta retracciones musculares en gastrocnemios, isquiotibiales y recto anterior del cuadriceps bilateral. presenta patrones de movimiento normales para miembro inferior izquierdo y regulares para miembro inferior derecho. Lo anterior no limita su funcionalidad pero si restringe su rol deportivo y recreativo.\',\n  \'evaluacion_final\' => \' A la revaloracion fisioterapeutica presenta dolor en talón y planta del pie derecho de 1/10 al reposo, de 1/10 a la palpación y de 1/10 movimiento de plantiflexión y dorsiflexión. Se palpa disminucion espasmos en musculo tibial anterior derecho y  gastrocnemio de forma bilateral ademas de disminucion edema de 0.5cm de diferencia en talón derecho respecto al talón izquierdo. Se valora mejoría en la longitud muscular en  gastrocnemios, isquiotibiales y recto anterior del cuadriceps bilateral. Presenta patrones de movimiento normales para miembro inferior izquierdo y buenos para miembro inferior derecho. Lo anterior no limita su funcionalidad ni restringe su rol deportivo y recreativo\',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-10-11 15:10:18'),(8055,5,'186.87.216.153',1,'cliente_sub_paquete',295,'Insert cliente_sub_paquete data:array (\n  \'fecha_limite\' => \'2017-10-19 00:00:00\',\n  \'id_sub_paquete\' => \'23\',\n  \'total_pagar\' => \'145000\',\n  \'id_cliente\' => \'50\',\n  \'descuento\' => \'0\',\n  \'fecha_inicio\' => \'2017-10-11\',\n  \'fecha_pago\' => \'2017-10-11\',\n)','2017-10-11 15:43:48'),(8056,5,'186.87.216.153',1,'sesion_sub_paquete',3739,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'295\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-10-11\',\n  \'numero\' => 1,\n)','2017-10-11 15:43:48'),(8057,5,'186.87.216.153',1,'sesion_sub_paquete',3740,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'295\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-10-11\',\n  \'numero\' => 2,\n)','2017-10-11 15:43:48'),(8058,5,'186.87.216.153',1,'sesion_sub_paquete',3741,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'295\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-10-11\',\n  \'numero\' => 3,\n)','2017-10-11 15:43:48'),(8059,5,'186.87.216.153',1,'sesion_sub_paquete',3742,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'295\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-10-11\',\n  \'numero\' => 4,\n)','2017-10-11 15:43:48'),(8060,5,'186.87.216.153',1,'sesion_sub_paquete',3743,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'295\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-10-11\',\n  \'numero\' => 5,\n)','2017-10-11 15:43:48'),(8061,5,'186.87.216.153',1,'cliente_sub_paquete',296,'Insert