=> \'Paciente que ingresa al servicio de fisioterapia con diagnostico médico ya mencionada con 10 meses de evolución, refiriendo caída como conductora de motocicleta  al comienzo del cuadro de. A la valoración encontramos prominencias oseas normales, dolor de 10/10 a la palpación de músculos paravertebrales lumbares, cara posterior de la cresta íliaca, sobre articulación sacroiliaca y coxis según escala análoga del dolor,flexión de cadera con rodilla extendida  de 70° bilateral con sensación final firme, retracciones en miembro inferior moderadas,  prueba de Lasegue negativa.\r\nDificultándole  sus actividades de la vida diaria y cotidiana ( sentarse sobre superficies rígidas) .\r\nSe le recomienda consulta médica buscando imagenología   diagnostica .\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'5\',\n  \'fecha_registro\' => \'2017-10-11 21:11:13\',\n  \'id_cliente\' => \'103\',\n)','2017-10-11 19:11:13'),(8081,66,'186.114.231.144',1,'cliente_historia_clinica',36,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular \',\n  \'plan_tratamiento\' => \'Modalidades físicas (crioterapia, ultrasonido, TENS, paquete caliente) masaje, estiramiento pasivos de hombro y cuello. \',\n  \'diagnostico\' => \'Síndrome abducción dolorosa del hombro\',\n  \'fecha_evaluacion_inicial\' => \'2017-10-09\',\n  \'fecha_evaluacion_final\' => \'1969-12-31\',\n  \'evaluacion_inicial\' => \'Paciente que ingresa al servicio de fisioterapia con diagnostico  médico ya mencionado con 6 meses de evolución. A la valoración inicial observamos prominencias oseas normales, espasmos musculares sobre elevador de la escapula, supraespinoso, trapecio fibras superiores y fibras medias, terete mayor y menor y dorsal ancho, dolor de 5/10 a la palpación en trapecios, supraespinoso, teretes, dorsal ancho, dolor al  8/10 al movimiento activo de flexo-extensión, abducción y aducción según escala análoga del dolor,fuerza muscular de 4/5 por antalgia,  con arcos de movilidad limitados por antalgia.\r\nDificultándole sus actividades de la vida diaria y básicas cotidiana ( vestirse y trabajar).\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'5\',\n  \'fecha_registro\' => \'2017-10-11 21:34:39\',\n  \'id_cliente\' => \'104\',\n)','2017-10-11 19:34:39'),(8082,99,'190.184.189.119',1,'cliente_historia_clinica',37,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Crioterapia: criomasaje durante 10 minutos.\r\nElectroterapia: TENS nivel sensitivo, duración: 15 minutos.\r\nMasaje sedativo: durante 15 minutos. \r\nTermoterapia superficial: (paquete caliente), tobillo y pierna izquierda durante 15 minutos. \r\nCaminata en banda sin fin, con inclinación de 0, velocidad de 3,5-4k/km por hora para brindar la reeducación sobre las fases de la marcha.\r\nEjercicios de rango de movimiento activo dorsiflexión, plantiflexión, inversión y eversión del tobillo (2-3 series, 10-15 repeticiones). \r\nEjercicios en cadenas cinética cerrada.\r\nEjercicios de coordinación, propiocepción y balance: desplazamientos en escalerillas, step y apoyo unipodal en superficie estable. \r\nEstiramiento mantenido para glúteos, isquiotibiales, plantiflexores, 2 series de 30 segundos, sostener relajar para isquiotibiales y recto anterior del cuádriceps.\r\nRecomendaciones verbales la importancia de suspender las actividades deportivas.\r\n\',\n  \'diagnostico\' => \'Fractura del tubérculo de Stieda. \',\n  \'fecha_evaluacion_inicial\' => \'2017-10-11\',\n  \'fecha_evaluacion_final\' => \'2017-10-12\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 12 años de edad, con diagnóstico médico de fractura del tubérculo de Stieda secundaria a trauma torsional del tobillo izquierdo durante práctica deportiva (futbol), quien recibió inmovilización con férula de yeso durante 21 días. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del cuello del pie izquierdo de intensidad 3/10 cm a la palpación y de 1/10 cm a los movimientos de plantiflexión y dorsiflexión según la escala numérica verbal. Presenta espasmos en músculos tibial anterior y gastronecmios del miembro inferior izquierdo. Edema de 2 cm de diferencia 4 cm hacia abajo del maléolo lateral izquierdo. Rangos de movilidad articular dentro de los valores normales. Fuerza muscular normal para el tibial anterior y posterior, peroneos y buena para plantiflexores. Retracciones musculares de gastronecmios, isquiotibiales, recto anterior del cuádriceps bilateralmente. Patrón de marcha asimétrico por presencia de mayor toma de peso en el miembro inferior derecho, disminución del choque de talón del miembro inferior izquierdo y mayor apoyo en el borde externo del pie. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol deportivo y recreativo. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'6\',\n  \'fecha_registro\' => \'2017-10-12 11:09:49\',\n  \'id_cliente\' => \'50\',\n)','2017-10-12 09:09:49'),(8083,99,'190.184.189.119',2,'cliente_historia_clinica',37,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Crioterapia: criomasaje durante 10 minutos.\r\nElectroterapia: TENS nivel sensitivo, duración: 15 minutos.\r\nMasaje sedativo: durante 15 minutos. \r\nTermoterapia superficial: (paquete caliente), tobillo y pierna izquierda durante 15 minutos. \r\nCaminata en banda sin fin, con inclinación de 0, velocidad de 3,5-4k/km por hora para brindar la reeducación sobre las fases de la marcha.\r\nEjercicios de rango de movimiento activo dorsiflexión, plantiflexión, inversión y eversión del tobillo (2-3 series, 10-15 repeticiones). \r\nEjercicios en cadenas cinética cerrada.\r\nEjercicios de coordinación, p