.153',2,'sesion_sub_paquete',3465,'Update sesion_sub_paquete data:array (\n  \'numero\' => 12,\n)','2017-10-13 04:33:09'),(8094,5,'186.87.216.153',1,'cliente_historia_clinica',38,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr Carlos Hernando Rico\',\n  \'plan_tratamiento\' => \'- Criomasaje en toda la zona afectada.\r\n- Calor local.\r\n- Corriente tipo TENS modulada en zona afectada.\r\n- Ultrasonido pulsado en cadera y glúteo izquierdos.\r\n- Masaje terapéutico de relajación en zona lumbar y miembro inferior izquierdo.\r\n- TFNP: sostener - relajar, isometricas alternas, estabilización rítmica.\r\n- Estiramientos pasivos generales.\r\n- Reeducación postural global.\r\n- Recomendaciones caseras.\r\n\',\n  \'diagnostico\' => \'Lumbago no especificado\',\n  \'fecha_evaluacion_inicial\' => \'2017-09-29\',\n  \'fecha_evaluacion_final\' => \'2017-10-14\',\n  \'evaluacion_inicial\' => \'Paciente de 68 años con diagnóstico médico de lumbago no especificado de 1 mes de evolución, con dolor de 10/10 en la EAV a nivel lumbar, cadera, zona inguinal y cresta iliaca anterosuperior de predominio izquierdo. espasmos severos en paravertebrales lumbares, glúteos, flexores de cadera, tensor de fascia lata y cuádiceps izquierdos, retracciones moderadas de lumbares bajos, isquiotibiales, plantiflexores y abductores de cadera bilateral. en la postura se observa leve ascenso de hombro derecho y ascenso de cadera izquierda lo que puede indicar una escoliosis dorsal izquierd y lumbar derecha; hiperlordosis cervical y lumbar e hipercifosis dorsal, protrucción de hombros y abdominal.\r\nEl dolor limita todas sus AVD como dormir, caminar y realizar su ejercicio en el gimnasio.\',\n  \'evaluacion_final\' => \'Finalizadas 9 del las 10 sesiones ordenadas se encuentra que\',\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'2\',\n  \'fecha_registro\' => \'2017-10-13 07:34:11\',\n  \'id_cliente\' => \'99\',\n)','2017-10-13 05:34:11'),(8095,5,'186.87.216.153',2,'cliente_historia_clinica',38,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr Carlos Hernando Rico\',\n  \'plan_tratamiento\' => \'- Criomasaje en toda la zona afectada.\r\n- Calor local.\r\n- Corriente tipo TENS modulada en zona afectada.\r\n- Ultrasonido pulsado en cadera y glúteo izquierdos.\r\n- Masaje terapéutico de relajación en zona lumbar y miembro inferior izquierdo.\r\n- TFNP: sostener - relajar, isometricas alternas, estabilización rítmica.\r\n- Estiramientos pasivos generales.\r\n- Reeducación postural global.\r\n- Recomendaciones caseras.\r\n\',\n  \'diagnostico\' => \'Lumbago no especificado\',\n  \'fecha_evaluacion_inicial\' => \'2017-09-29\',\n  \'fecha_evaluacion_final\' => \'2017-10-14\',\n  \'evaluacion_inicial\' => \'Paciente de 68 años con diagnóstico médico de lumbago no especificado de 1 mes de evolución, con dolor de 10/10 en la EAV a nivel lumbar, cadera, zona inguinal y cresta iliaca anterosuperior de predominio izquierdo. espasmos severos en paravertebrales lumbares, glúteos, flexores de cadera, tensor de fascia lata y cuádiceps izquierdos, retracciones moderadas de lumbares bajos, isquiotibiales, plantiflexores y abductores de cadera bilateral. Fuerza muscular 4/5 en tronco y miembros inferiores. En la postura se observa leve ascenso de hombro derecho y ascenso de cadera izquierda lo que puede indicar una escoliosis dorsal izquierda y lumbar derecha; hiperlordosis cervical y lumbar e hipercifosis dorsal, protrucción de hombros y abdominal.\r\nEl dolor limita todas sus AVD como dormir, caminar y realizar su ejercicio en el gimnasio.\',\n  \'evaluacion_final\' => \'Finalizadas 9 del las 10 sesiones ordenadas se encuentra que el dolor disminuyó a 3/ 10 en la EAV a nivel glúteo y paraespinal lumbar y es de 7/10 a nivel de cadera y espina iliaca anterosuperior izquierdas. los espasmos desaparecieron en pierna y cadera izquierda y persisten leves en glúteo derecho. Disminuyeron levemente las retracciones. Se conserva la fuerza muscular. Manifiesta que el dolor aun limita algunas de sus AVD como dormir y caminar varias cuadras. Se dieron indicaciones de ejercicios y cuidados caseros.\',\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'2\',\n)','2017-10-13 05:49:45'),(8096,5,'186.87.216.153',2,'persona',105,'Update persona data:array (\n  \'email\' => \'gloriosan35@gmail.com\',\n  \'movil\' => \'3166981023\',\n  \'genero\' => \'2\',\n  \'barrio\' => \'CABECERA\',\n  \'telefono\' => NULL,\n  \'direccion\' => \'CLL 44 N 35 41  APTO 301\',\n  \'foto_perfil\' => \'37795992.jpg\',\n  \'primer_nombre\' => \'GLORIA \',\n  \'segundo_nombre\' => \'LUCY\',\n  \'primer_apellido\' => \'SANTOS \',\n  \'segundo_apellido\' => \'DE RIVERA\',\n  \'fecha_nacimiento\' => \'1949-02-24\',\n  \'tipo_identificacion\' => \'2\',\n  \'ciudad\' => \'BUCARAMANGA\',\n  \'numero_identificacion\' => \'37795992\',\n)','2017-10-13 06:04:05'),(8097,5,'186.87.216.153',2,'cliente_historia_clinica',38,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr Carlos Hernando Rico\',\n  \'plan_tratamiento\' => \'- Criomasaje en toda la zona afectada.\r\n- Calor local.\r\n- Corriente tipo TENS modulada en zona afectada.\r\n- Ultrasonido pulsado en cadera y glúteo izquierdos.\r\n- Masaje terapéutico de relajación en zona lumbar y miembro inferior izquierdo.\r\n- TFNP: sostener - relajar, isometricas alternas, estabilización rítmica.\r\n- Estiramientos pasivos generales.\r\n- Reeducación postural global.\r\n- Recomendaciones caseras.\r\n\',\n  \'diagnostico\' => \'Lumbago no especificado\',\n  \'fecha_evaluacion_inicial\' => \'2017-09-29\',\n  \'fecha_evaluacion_final\' => \'2017-10-14\',\n  \'evaluacion_inicial\' => \'Paciente de 68 años con diagnóstico médico de lumbago no especificado de 1 mes de evolución, con dolor de 10/10 en la EAV a nivel lumbar, cadera, zona inguinal y cresta iliaca anterosuperior de predominio izquierdo. espasmos severos en paravertebrales lumbares, glúteos, 