cala análoga del dolor, flexión de cadera con rodilla extendida  de 70° bilateral con sensación final firme, retracciones en miembro inferior moderadas,  prueba de Lasegue negativa.\r\nEl dolor limita  sus actividades de la vida diaria y cotidiana (sentarse sobre superficies rígidas) .\r\nSe le recomienda consulta médica buscando imagenología   diagnostica .\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'5\',\n)','2017-10-17 06:00:19'),(8153,99,'181.131.75.205',2,'cliente_historia_clinica',37,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'Crioterapia: criomasaje durante 10 minutos.\r\nElectroterapia: TENS nivel sensitivo, duración: 15 minutos.\r\nMasaje sedativo: durante 15 minutos. \r\nTermoterapia superficial: (paquete caliente), tobillo y pierna izquierda durante 15 minutos. \r\nCaminata en banda sin fin, con inclinación de 0, velocidad de 3,5-4k/km por hora para brindar la reeducación sobre las fases de la marcha.\r\nEjercicios en cadenas cinética cerrada.\r\nEjercicios de coordinación, propiocepción y balance: desplazamientos en escalerillas, step y apoyo unipodal en superficie estable. \r\nEstiramiento mantenido para glúteos, isquiotibiales, plantiflexores, 2 series de 30 segundos, sostener relajar para isquiotibiales y recto anterior del cuádriceps.\r\nRecomendaciones verbales sobre la importancia de suspender las actividades deportivas.\r\n\',\n  \'diagnostico\' => \'Fractura del tubérculo de Stieda. \',\n  \'fecha_evaluacion_inicial\' => \'2017-10-11\',\n  \'fecha_evaluacion_final\' => \'2017-10-12\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 12 años de edad, con diagnóstico médico de fractura del tubérculo de Stieda secundaria a trauma torsional del tobillo izquierdo durante práctica deportiva (futbol), quien recibió inmovilización con férula de yeso durante 21 días. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del cuello del pie izquierdo de intensidad 3/10 cm a la palpación y de 1/10 cm a los movimientos de plantiflexión y dorsiflexión según la escala numérica verbal. Presenta espasmos en músculos tibial anterior y gastronecmios del miembro inferior izquierdo. Edema de 2 cm de diferencia a 4 cm por debajo del maléolo lateral izquierdo. Rangos de movilidad articular dentro de los valores normales. Fuerza muscular normal para el tibial anterior y posterior, peroneos y buena para plantiflexores. Retracciones musculares de gastronecmios, isquiotibiales, recto anterior del cuádriceps bilateralmente. Patrón de marcha asimétrico por presencia de mayor toma de peso en el miembro inferior derecho, disminución del choque de talón del miembro inferior izquierdo y mayor apoyo en el borde externo del pie. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol deportivo y recreativo. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'6\',\n)','2017-10-17 12:21:14'),(8154,5,'186.87.216.153',2,'sesion_sub_paquete',3732,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'2\',\n  \'fecha_hora_inicio\' => \'2017-10-17 08:00:00\',\n  \'fecha_hora_fin\' => \'2017-10-17 09:00:00\',\n  \'fecha_modificacion\' => \'2017-10-17\',\n  \'estado\' => 1,\n)','2017-10-17 15:22:04'),(8155,5,'186.87.216.153',2,'sesion_sub_paquete',3714,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'6\',\n  \'fecha_hora_inicio\' => \'2017-10-17 17:30:00\',\n  \'fecha_hora_fin\' => \'2017-10-17 18:30:00\',\n  \'fecha_modificacion\' => \'2017-10-17\',\n  \'estado\' => 1,\n)','2017-10-17 15:22:16'),(8156,5,'186.87.216.153',2,'sesion_sub_paquete',3738,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'6\',\n  \'fecha_hora_inicio\' => \'2017-10-17 18:30:00\',\n  \'fecha_hora_fin\' => \'2017-10-17 19:30:00\',\n  \'fecha_modifica