entante\' => \'2\',\n  \'fecha_hora_inicio\' => \'2017-10-31 09:00:00\',\n  \'fecha_hora_fin\' => \'2017-10-31 10:00:00\',\n  \'fecha_modificacion\' => \'2017-10-26\',\n  \'estado\' => 1,\n)','2017-10-26 06:31:45'),(8461,99,'181.58.225.75',2,'cliente_historia_clinica',34,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'particular\',\n  \'plan_tratamiento\' => \'Modalidades físicas (paquete caliente, TENS, ultrasonido), masaje, ejercicios isometricos , estiramientos de los miembros superiores.\',\n  \'diagnostico\' => \'Tendinitis del tendón largo del  bíceps \',\n  \'fecha_evaluacion_inicial\' => \'2017-10-09\',\n  \'fecha_evaluacion_final\' => \'1969-12-31\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino de 84 años de edad con diagnóstica de tendinitis del tendón largo del bíceps izquierdo. Presenta dolor de 6/10 en la EAV  al reposo (matutino) y 3/10 a los  movimiento por encima de su cabeza. Espasmos leves en Trapecio fibras superiores, supraespinoso, deltoides fibras medias e inflamación sobre el tendón de la cabeza larga del biceps .Flexión de hombro izquierdo de 130°, extensión 30°, abd 90°, rotación interna 30° y rotación externa 40°. Patrones de movimiento regulares para miembro superior izquierdo con mayor compromiso del componente rotatorio. Hay alteración en todas sus actividades de la vida diaria y básicas cotidianas donde involucre el miembro superior izquierdo (cargar paquetes ).\',\n  \'evaluacion_final\' => \'Paciente de género masculino de 84 años de edad, con diagnóstico médico de tendinitis del tendón largo del bíceps braquial izquierdo. Quien finaliza tratamiento de fisioterapia después de 12 sesiones, a la revaloración persiste dolor de intensidad 2/10 a los movimientos de rotación externa, aducción horizontal del hombro izquierdo según la escala numérica de dolor, no presenta dolor al reposo ni a la palpación, ausencia de espasmos musculares, presenta mejoramiento en los movimientos de flexión (0°-140°), extensión (0°-45°), abducción (0°-130°), rotación interna (0°-60°) y rotación externa (0°-50°) del hombro izquierdo, patrones de movimiento buenos para el miembro superior izquierdo con mayor compromiso de la movilidad del pivote proximal. Presenta limitación leve en las actividades de elevación y alcances con el miembro superior izquierdo, sin restricción en la participación en sus roles. \',\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'6\',\n)','2017-10-27 11:28:31'),(8462,99,'181.58.225.75',2,'cliente_historia_clinica',34,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'particular\',\n  \'plan_tratamiento\' => \'Modalidades físicas (paquete caliente, TENS, ultrasonido), masaje, ejercicios isometricos , estiramientos de los miembros superiores.\',\n  \'diagnostico\' => \'Tendinitis del tendón largo del  bíceps \',\n  \'fecha_evaluacion_inicial\' => \'2017-10-09\',\n  \'fecha_evaluacion_final\' => \'2017-10-25\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino de 84 años de edad con diagnóstica de tendinitis del tendón largo del bíceps izquierdo. Presenta dolor de 6/10 en la EAV  al reposo (matutino) y 3/10 a los  movimiento por encima de su cabeza. Espasmos leves en Trapecio fibras superiores, supraespinoso, deltoides fibras medias e inflamación sobre el tendón de la cabeza larga del biceps .Flexión de hombro izquierdo de 130°, extensión 30°, abd 90°, rotación interna 30° y rotación externa 40°. Patrones de movimiento regulares para miembro superior izquierdo con mayor compromiso del componente rotatorio. Hay alteración en todas sus actividades de la vida diaria y básicas cotidianas donde involucre el miembro superior izquierdo (cargar paquetes ).\',\n  \'evaluacion_final\' => \'Paciente de género masculino de 84 años de edad, con diagnóstico médico de tendinitis del tendón largo del bíceps braquial izquierdo. Quien finaliza tratamiento de fisioterapia después de 12 sesiones, a la revaloración persiste dolor de int