cion_inicial\' => \'2017-10-09\',\n  \'fecha_evaluacion_final\' => \'2017-10-25\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino de 84 años de edad con diagnóstica de tendinitis del tendón largo del bíceps izquierdo. Presenta dolor de 6/10 en la EAV  al reposo (matutino) y 3/10 a los  movimiento por encima de su cabeza. Espasmos leves en Trapecio fibras superiores, supraespinoso, deltoides fibras medias e inflamación sobre el tendón de la cabeza larga del biceps .Flexión de hombro izquierdo de 130°, extensión 30°, abd 90°, rotación interna 30° y rotación externa 40°. Patrones de movimiento regulares para miembro superior izquierdo con mayor compromiso del componente rotatorio. Hay alteración en todas sus actividades de la vida diaria y básicas cotidianas donde involucre el miembro superior izquierdo (cargar paquetes ).\',\n  \'evaluacion_final\' => \'Paciente de género masculino de 84 años de edad, con diagnóstico médico de tendinitis del tendón largo del bíceps braquial izquierdo. Quien finaliza tratamiento de fisioterapia después de 12 sesiones, a la revaloración persiste dolor de intensidad 2/10 a los movimientos de rotación externa, aducción horizontal del hombro izquierdo según la escala numérica de dolor, no presenta dolor al reposo ni a la palpación, ausencia de espasmos musculares, presenta mejoramiento en los movimientos de flexión (0°-140°), extensión (0°-45°), abducción (0°-130°), rotación interna (0°-60°) y rotación externa (0°-50°) del hombro izquierdo, patrones de movimiento buenos para el miembro superior izquierdo con mayor compromiso de la movilidad del pivote proximal. Presenta limitación leve en las actividades de elevación y alcances con el miembro superior izquierdo, sin restricción en la participación en sus roles. \',\n  \'sesiones_realizadas\' => \'12.00\',\n  \'id_representante\' => \'6\',\n)','2017-10-27 11:33:24'),(8465,99,'181.58.225.75',2,'cliente_historia_clinica',37,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'Modalidades físicas: \r\nCrioterapia (criomasaje) Electroterapia (TENS nivel sensitivo), Masaje sedativo, Termoterapia superficial (paquete caliente).\r\n\r\nEjercicio terapéutico:\r\nCaminata en banda sin fin, Ejercicios en trx, Ejercicios de coordinación, propiocepción y balance, ejercicios funcionales para fortalecimiento de los miembros inferiores, Estiramiento mantenido \r\n\r\n\',\n  \'diagnostico\' => \'Fractura del astrágalo Vs Tuberculo de Stieda \',\n  \'fecha_evaluacion_inicial\' => \'2017-10-11\',\n  \'fecha_evaluacion_final\' => \'2017-10-26\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 12 años de edad, con diagnóstico médico de fractura del astrágalo secundaria a trauma torsional del tobillo izquierdo durante práctica deportiva (futbol), quien recibió inmovilización con férula de yeso durante 21 días. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del cuello del pie izquierdo de intensidad 3/10  a la palpación y de 1/10 a los movimientos de plantiflexión y dorsiflexión según la escala numérica verbal de dolor. Presenta espasmos en músculos tibial anterior y gastrocnemios del miembro inferior izquierdo. Edema de 2 cm de diferencia localizado 4 cm por debajo del maléolo lateral izquierdo. Rangos de movilidad articular dentro de los valores normales. Fuerza muscular de 5 para el tibial anterior y posterior, peroneos y de 4 para plantiflexores del miembro inferior derecho, no evaluados en el izquierdo por dolor. Retracciones musculares de gastrocnemios, isquiotibiales, recto anterior del cuádriceps bilateralmente. Patrón de marcha asimétrico por presencia de mayor toma de peso en el miembro inferior derecho, disminución del choque de talón del miembro inferior izquierdo y mayor apoyo en el borde externo del pie. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol deportivo y recreativo. \',\n  \'evaluacion_final\' => \'Paciente de género masculino de 12 años de edad, con diagnóstico médico de fractura del astrágalo secundaria a trauma torsional del tobillo izquierdo durante práctica deportiva (futbol), quien recibió inmovilización con férula de yeso durante 21 días. Quien finaliza tratamiento de fisioterapia después de 10 sesiones, a la revaloración no presenta dolor ni espasmos musculares, ausencia de edema en tobillo izquierdo. Presenta mejoría en la propiocepción y balance del tobillo izquierdo, simetría en la toma de peso de los dos miembros inferiores durante el patrón de marcha. El paciente es independiente para las actividades de la vida diaria, pero presenta leve restricción en la participación en su rol deportivo. \',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-10-27 11:45:02'),(8466,99,'181.58.225.75',1,'cliente_historia_clinica',39,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => NULL,\n  \'diagnostico\' => \'Esguince recidivante de tobillo izquierdo. \',\n  \'fecha_evaluacion_inicial\' => \'2017-10-24\',\n  \'fecha_evaluacion_final\' => \'2017-11-06\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino de 10 años de edad. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n  \'fecha_registro\' => \'2017-10-27 13:48:25\',\n  \'id_cliente\' => \'109\',\n)','2017-10-27 11:48:25'),(8467,99,'181.58.225.75',2,'cliente_historia_clinica',36,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular \',\n  \'plan_tratamiento\' => \'Modalidades físicas (crioterapia, ultrasonido, TENS, paquete caliente) masaje sedativo, sostener-relajar, estiramiento mantenido de cabeza y cuello, hombro, y región dorsal y lumbar. \',\n  \'diagnostico\' => \'Síndrome abducción dolorosa del hombro, escoliosis dorsal derecha. \',\n  \'fecha_evaluacion_in