paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol deportivo y recreativo. \',\n  \'evaluacion_final\' => \'Paciente de género masculino de 12 años de edad, con diagnóstico médico de fractura del astrágalo secundaria a trauma torsional del tobillo izquierdo durante práctica deportiva (futbol), quien recibió inmovilización con férula de yeso durante 21 días. Finaliza tratamiento de fisioterapia después de 10 sesiones, a la revaloración no presenta dolor ni espasmos musculares, ausencia de edema en tobillo izquierdo. Se valora mejoría en la longitud muscular en gastrocnemios, isquiotibiales y recto anterior del cuadriceps bilateral. Presenta mejoría en la propiocepción y balance del tobillo izquierdo, simetría en la toma de peso de los dos miembros inferiores durante el patrón de marcha. El paciente es independiente para las actividades de la vida diaria, pero presenta leve restricción en la participación en su rol deportivo. \',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-10-30 09:34:32'),(8473,99,'190.13.47.42',2,'cliente_historia_clinica',39,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'MODALIDADES FISICAS\r\nCrioterapia (criomasaje), Electroterapia: TENS Modo ALT-TENS (nivel motor confortable), Masaje sedativo, Termoterapia superficial (paquete caliente). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPEUTICO:\r\nCaminata en banda sin fin.\r\nFortalecimiento muscular a través de ejercicios uniplanares con resistencia externa: bandas elásticas (amarilla) y/o equipos de suspensión como TRX o autocargas en cadenas cinética cerrada y abiertas.\r\nEjercicios de coordinación, propiocepción y balance: desplazamientos en escalerillas, caminata en puntas de pie y en talones, ejercicio de apoyo unipodal sobre superficie estable e inestable, ejercicio de alcance anterior en apoyo unipodal, puente en apoyo unipodal, Ejercicios de balance en balón.\r\nEstiramiento mantenido. \r\n\r\n\',\n  \'diagnostico\' => \'Esguince recidivante de tobillo izquierdo. \',\n  \'fecha_evaluacion_inicial\' => \'2017-10-24\',\n  \'fecha_evaluacion_final\' => \'2017-11-06\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 10 años de edad, con diagnóstico médico de esguince recidivante de ligamentos externos del tobillo izquierdo de un año de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del maléolo lateral del tobillo izquierdo de intensidad 8/10 a la palpación y de 5/10 a los movimientos de inversión y durante la actividad deportiva (futbol) según la escala numérica verbal. Presenta espasmos en músculos peroneos y gastronecmios del miembro inferior izquierdo. Mediante la medición perimétrica no se encuentran diferencias significativas para edema en el miembro inferior izquierdo. A la movilización pasiva del pie se observa aumento de la laxitud ligamentosa y prueba de inversión forzada positiva. A la evaluación de la fuerza muscular del tobillo y pie se encuentras notas de 4 para peroneos anterior, largo y corto, para el flexor largo y corto del hallux del miembro inferior izquierdo y para los plantiflexores del miembro inferior derecho y de 3 para plantiflexores del miembro inferior izquierdo por dolor. Retracciones musculares leves de gastronecmios e isquiotibiales, bilateralmente. Patrón de marcha asimétrico por presencia de mayor toma de peso en el miembro inferior derecho, disminución del choque de talón izquierdo. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol deportivo y recreativo. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-10-30 10:44:10'),(8474,65,'190.96.234.96',1,'cliente_historia_clinica',40,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' 