nsión como TRX o autocargas en cadenas cinética cerrada y abiertas.\r\n\r\nEjercicios de coordinación, propiocepción y balance: desplazamientos en escalerillas, caminata en puntas de pie y en talones, ejercicio de apoyo unipodal sobre superficie estable e inestable, ejercicio de alcance anterior en apoyo unipodal, puente en apoyo unipodal, \r\n\r\nEjercicios de balance en balón.\r\n\r\nEstiramiento mantenido. \r\n\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-02\',\n  \'fecha_evaluacion_final\' => \'2017-11-17\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 38 años de edad, con diagnóstico médico de esguince de ligamentos externos del tobillo derecho de tres semanas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del maléolo lateral del tobillo derecho de intensidad 6/10 a la palpación y de 7/10 a los movimientos de inversión y en bipedestación prolongada según la escala numérica verbal. Presenta espasmos en músculos peroneos, tibial anterior y gastronecmios del miembro inferior derecho. Presenta edema de 3 cm de diferencia localizado 4 cm hacia abajo del maléolo lateral izquierdo. Disminución del rango de movimiento de inversión (0°-25°) con sensación final vacío por presencia de dolor. Fuerza muscular de 4 para peroneos y plantiflexores derechos. Retracciones musculares leves de isquiotibiales bilateralmente. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol laboral y recreativo. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n  \'fecha_registro\' => \'2017-11-08 14:43:02\',\n  \'id_cliente\' => \'112\',\n)','2017-11-08 12:43:02'),(8834,99,'186.183.214.201',2,'cliente_historia_clinica',42,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Caminata en banda sin fin.\r\n\r\nFortalecimiento muscular a través de ejercicios uniplanares con resistencia externa: bandas elásticas (amarilla) y/o equipos de suspensión como TRX o autocargas en cadenas cinética cerrada y abiertas.\r\n\r\nEjercicios de coordinación, propiocepción y balance: desplazamientos en escalerillas, caminata en puntas de pie y en talones, ejercicio de apoyo unipodal sobre superficie estable e inestable, ejercicio de alcance anterior en apoyo unipodal, puente en apoyo unipodal, \r\n\r\nEjercicios de balance en balón.\r\n\r\nEstiramiento mantenido. \r\n\',\n  \'diagnostico\' => \'Esguince de ligamentos laterales del tobillo derecho\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-02\',\n  \'fecha_evaluacion_final\' => \'2017-11-17\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 38 años de edad, con diagnóstico médico de esguince de ligamentos externos del tobillo derecho de tres semanas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del maléolo lateral del tobillo derecho de intensidad 6/10 a la palpación y de 7/10 a los movimientos de inversión y en bipedestación prolongada según la escala numérica verbal. Presenta espasmos en músculos peroneos, tibial anterior y gastronecmios del miembro inferior derecho. Presenta edema de 3 cm de diferencia localizado 4 cm hacia abajo del maléolo lateral izquierdo. Disminución del rango de movimiento de inversión (0°-25°) con sensación final vacío por presencia de dolor. Fuerza muscular de 4 para peroneos y plantiflexores derechos. Retracciones musculares leves de isquiotibiales bilateralmente. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol laboral y recreativo. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-08 12:44:09'),(8835,99,'186.183.214.201',1,'cliente_historia_clinica',43,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'MODALIDADES FISICAS\r\nElectroterapia: TENS (nivel sensitivo confortable), Masaje sedativo, Termoterapia superficial (paquete caliente), Ultrasonido terapéutico (modo: continuo). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPÉUTICO:\r\nEstiramiento muscular mantenido: paravertebrales dorsales y lumbares, isquiotibiales, aductores de cadera, glúteos y musculatura lateral del tronco.\r\nEjercicio Cat-camel, Bird-Dog, ejercicio de anteversión y retroversión de la pelvis en supino sobre colchoneta. \r\nFortalecimiento muscular de de abdominales, extensores de tronco y glúteos. \r\n\',\n  \'diagnostico\' => \'Lumbago no especificado.\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-07\',\n  \'fecha_evaluacion_final\' => \'2017-11-21\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 65 años de edad, con diagnóstico médico de lumbago no especificado de tres semanas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región lumbar de intensidad 2/10 a la palpación y de 6/10 a los movimientos de flexión del tronco según la escala numérica verbal. Presenta espasmos en musculatura paravertebral lumbar y dorsal. Patrones de movimiento del tronco superior buenos por compromiso de la fuerza. A la evaluación de la fuerza muscular del tronco se encuentra nota de 3 para el recto anterior del abdomen, oblicuos mayor y menor derecho e izquierdo y extensores toracolumbares. A la evaluación de la longitud muscular presenta retracciones de la musculatura posterior (paravertebrales lumbares e isquiotibiales), de aductores y del recto anterior del cuádriceps bilateral en la prueba de Thomas. Pruebas de Lasegue y Bragar negativas. A la evaluación de la postura se observa en la vista anterior.. En la vista posterior se corroboran hallazgos encontrados en la vista anterior. En las vistas laterales se observa. El paciente es independiente para todas las actividades de la vida diaria pero presenta dolor que lo limita para levantar un objeto del suelo y amarrarse los zapatos.  \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n  \'fecha_registro\' => \'2017-11-08 14:46:28\',\n  \'id_cliente\' => \'113\',\n)','2017-11-08 12:46:28'),(8836,99,'186.183.214.201',2,'cliente_historia_clinica',43,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'MODALIDADES FISICAS\r\nElectroterapia: TENS (nivel sensitivo confortable), Masaje sedativo, Termoterapia superficial (paquete caliente), Ultrasonido terapéutico (modo: continuo). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPÉUTICO:\r\nEstiramiento muscular mantenido: paravertebrales dorsales y lumbares, isquiotibiales, aductores de cadera, glúteos y musculatura lateral del tronco.\r\nEjercicio Cat-camel, Bird-Dog, ejercicio de anteversión y retroversión de la pelvis en supino sobre colchoneta. \r\nFortalecimiento muscular de de abdominales, extensores de tronco y glúteos. \r\n\',\n  \'diagnostico\' => \'Lumbago no especificado.\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-07\',\n  \'fecha_evaluacion_final\' => \'2017-11-21\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 67 años de edad, con diagnóstico médico de lumbago no especificado de tres semanas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región lumbar de intensidad 2/10 a la palpación y de 6/10 a los movimientos de flexión del tronco según la escala numérica verbal. Presenta espasmos en musculatura paravertebral lumbar y dorsal. Patrones de movimiento del tronco superior buenos por compromiso de la fuerza. A la evaluación de la fuerza muscular del tronco se encuentra nota de 3 para el recto anterior del abdomen, oblicuos mayor y menor derecho e izquierdo y extensores toracolumbares. A la evaluación de la longitud muscular presenta retracciones de la musculatura posterior (paravertebrales lumbares e isquiotibiales), de aducto