saje sedativo, Termoterapia superficial (paquete caliente). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPÉUTICO:\r\nEstiramiento muscular mantenido: flexores de muñeca, pronadores, triceps, pectoral.\r\nDeslizamientos miotendinosos\r\nEstiramientos neurodinamicos\r\n\',\n  \'diagnostico\' => \'Neuropatia compresiva ulnar bilateral\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-07\',\n  \'fecha_evaluacion_final\' => \'2017-11-29\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 36 años de edad, con diagnóstico médico de neuropatía compresiva del nervio ulnar de tres meses de evolución. A la evaluación fisioterapéutica inicial no refiere dolor, presenta parestesias en 4° y 5° dedo bilateralmente. Presenta espasmos en musculatura flexora de muñeca y dedos y bíceps braquial. Rangos de movilidad articular de a muñeca y dedos dentro de los valores normales. A la evaluación de la fuerza no se encuentra alteración. El paciente es independiente en todas las actividades de la vida diaria, pero presenta limitación para el uso del computador y celular. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'12.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-08 19:09:37'),(8860,99,'186.183.232.55',2,'cliente_historia_clinica',43,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'MODALIDADES FISICAS\r\nElectroterapia: TENS (nivel sensitivo confortable), Masaje sedativo, Termoterapia superficial (paquete caliente), Ultrasonido terapéutico (modo: continuo). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPÉUTICO:\r\nEstiramiento muscular mantenido: paravertebrales dorsales y lumbares, isquiotibiales, aductores de cadera, glúteos y musculatura lateral del tronco.\r\nEjercicio Cat-camel, Bird-Dog, ejercicio de anteversión y retroversión de la pelvis en supino sobre colchoneta. \r\nFortalecimiento muscular de de abdominales, extensores de tronco y glúteos. \r\n\',\n  \'diagnostico\' => \'Lumbago no especificado.\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-07\',\n  \'fecha_evaluacion_final\' => \'2017-11-21\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 67 años de edad, con diagnóstico médico de lumbago no especificado de tres semanas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región lumbar de intensidad 2/10 a la palpación y de 6/10 a los movimientos de flexión del tronco según la escala numérica verbal. Presenta espasmos en musculatura paravertebral lumbar y dorsal. Patrones de movimiento del tronco superior buenos por compromiso de la fuerza. A la evaluación de la fuerza muscular del tronco se encuentra nota de 3 para el recto anterior del abdomen, oblicuos mayor y menor derecho e izquierdo y extensores toracolumbares. A la evaluación de la longitud muscular presenta retracciones de la musculatura posterior (paravertebrales lumbares e isquiotibiales), de aductores y del recto anterior del cuádriceps bilateral en la prueba de Thomas. Pruebas de Lasegue y Bragar negativas. El paciente es independiente para todas las actividades de la vida diaria pero presenta dolor que lo limita para levantar un objeto del suelo y amarrarse los zapatos.  \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-08 19:12:49'),(8861,99,'186.183.232.55',2,'cliente_historia_clinica',44,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Nelson Ivan Gonzales \',\n  \'plan_tratamiento\' => \'MODALIDADES FÍSICAS:\r\nUltrasonido terapéutico (pulsado), Crioterapia (criomasaje), Masaje sedativo, Termoterapia superficial (paquete caliente). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPÉUTICO:\r\nEstiramiento muscular mantenido: flexores de muñeca, pronadores, triceps, pectoral.\r\nDeslizamientos miotendinosos\r\nEstiramientos neurodinamicos\r\n\',\n  \'diagnostico\' => \'Neuropatía focal compresiva del nervio ulnar  bilateral.\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-07\',\n  \'fecha_evaluacion_final\' => \'2017-11-29\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 36 años de edad, con diagnóstico médico de neuropatía focal compresiva del nervio ulnar en codo bilateral, de tres meses de evolución.  A la evaluación fisioterapéutica inicial no refiere dolor, presenta parestesias en 4° y 5° dedo bilateralmente. Presenta espasmos en musculatura flexora de muñeca y dedos y bíceps braquial. Rangos de movilidad articular de a muñeca y dedos dentro de los valores normales. A la evaluación de la fuerza no se encuentra alteración. El paciente es independiente en todas las actividades de la vida diaria, pero presenta limitación para el uso del computador y celular. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'12.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-08 19:32:59'),(8862,5,'181.58.77.230',2,'sesion_sub_paquete',4015,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'6\',\n  \'fecha_hora_inicio\' => \'2017-11-08 18:00:00\',\n  \'fecha_hora_fin\' => \'2017-11-08 19:00:00\',\n  \'fecha_modificacion\' => \'2017-11-09\',\n  \'estado\' => 1,\n)','2017-11-09 15:25:46'),(8863,5,'181.58.77.230',2,'sesion_sub_paquete',4016,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'6\',\n  \'fecha_hora_inicio\' => \'2017-11-09 18:00:00\',\n  \'fecha_hora_fin\' => \'2017-11-09 19:00:00\',\n  \'fecha_modificacion\' => \'2017-11-09\',\n  \'estado\' => 1,\n)','2017-11-09 15:26:00'),(8864,5,'181.58.77.230',2,'sesion_sub_paquete',4017,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'6\',\n  \'fecha_hora_inicio\' => \'2017-11-10 17:00:00\',\n  \'fecha_hora_fin\' => \'2017-11-10 18:00:00\',\n  \'fecha_modificacion\' => \'2017-11-09\',\n  \'estado\' => 1,\n)','2017-11-09 15:26:13'),(8865,5,'181.58.77.230',2,'sesion_sub_paquete',4017,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'6\',\n  \'fecha_hora_inicio\' => \'2017-1