'direccion\' => \'CRA 55 N 71 23 CASA 9\',\n  \'foto_perfil\' => \'13514217.jpg\',\n  \'primer_nombre\' => \'JUAN \',\n  \'segundo_nombre\' => \'FELIPE\',\n  \'primer_apellido\' => \'VEGA\',\n  \'segundo_apellido\' => NULL,\n  \'fecha_nacimiento\' => \'1977-12-19\',\n  \'tipo_identificacion\' => \'2\',\n  \'ciudad\' => \'BUCARAMANGA\',\n  \'numero_identificacion\' => \'13514217\',\n)','2017-11-09 17:36:48'),(8872,99,'190.13.48.227',2,'cliente_historia_clinica',39,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'MODALIDADES FISICAS\r\nCrioterapia (criomasaje), Electroterapia: TENS Modo ALT-TENS (nivel motor confortable), Masaje sedativo, Termoterapia superficial (paquete caliente). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPEUTICO:\r\nCaminata en banda sin fin.\r\nFortalecimiento muscular a través de ejercicios uniplanares con resistencia externa: bandas elásticas (amarilla) y/o equipos de suspensión como TRX o autocargas en cadenas cinética cerrada y abiertas.\r\nEjercicios de coordinación, propiocepción y balance: desplazamientos en escalerillas, caminata en puntas de pie y en talones, ejercicio de apoyo unipodal sobre superficie estable e inestable, ejercicio de alcance anterior en apoyo unipodal, puente en apoyo unipodal, Ejercicios de balance en balón.\r\nEstiramiento mantenido. \r\n\r\n\',\n  \'diagnostico\' => \'Esguince recidivante de tobillo izquierdo. \',\n  \'fecha_evaluacion_inicial\' => \'2017-10-24\',\n  \'fecha_evaluacion_final\' => \'2017-11-08\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 10 años de edad, con diagnóstico médico de esguince recidivante de ligamentos externos del tobillo izquierdo de un año de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del maléolo lateral del tobillo izquierdo de intensidad 8/10 a la palpación y de 5/10 a los movimientos de inversión y durante la actividad deportiva (futbol) según la escala numérica verbal. Presenta espasmos en músculos peroneos y gastronecmios del miembro inferior izquierdo. Mediante la medición perimétrica no se encuentran diferencias significativas para edema en el miembro inferior izquierdo. A la movilización pasiva del pie se observa aumento de la laxitud ligamentosa y prueba de inversión forzada positiva. A la evaluación de la fuerza muscular del tobillo y pie se encuentras notas de 4 para peroneos anterior, largo y corto, para el flexor largo y corto del hallux del miembro inferior izquierdo y para los plantiflexores del miembro inferior derecho y de 3 para plantiflexores del miembro inferior izquierdo por dolor. Retracciones musculares leves de gastronecmios e isquiotibiales, bilateralmente. Patrón de marcha asimétrico por presencia de mayor toma de peso en el miembro inferior derecho, disminución del choque de talón izquierdo. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol deportivo y recreativo. \',\n  \'evaluacion_final\' => \'Paciente de género masculino de 10 años de edad, con diagnóstico médico de esguince recidivante de ligamentos externos del tobillo izquierdo de un año de evolución. Quien finaliza tratamiento de fisioterapia después de 10 sesiones, a la revaloración el paciente refiere exacerbación del dolor durante el movimiento que puede estar relacionada con la actividad deportiva (futbol) realizada hace unos días. Ausencia de espasmos musculares, mejoramiento en la fuerza muscular de los peroneos. Disminución de las retracciones musculares de gastronecmios e isquiotibiales, bilateralmente. Sin embargo reaparece patrón de marcha asimétrico con presencia de mayor toma de peso en el miembro inferior derecho, disminución del choque de talón izquierdo. \r\n\r\n\',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-10 14:32:15'),(8873,99,'190.13.48.227',2,'cliente_historia_clinica',43,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'MODALIDADES FISICAS\r\nElectroterapia: TENS (nivel sensitivo confortable), Masaje sedativo, Termoterapia superficial (paquete caliente), Ultrasonido terapéutico (modo: continuo). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPÉUTICO:\r\nEstiramiento muscular mantenido: paravertebrales dorsales y lumbares, isquiotibiales, aductores de cadera, glúteos y musculatura lateral del tronco.\r\nEjercicio Cat-camel, ejercicio de anteversión y retroversión de la pelvis en supino sobre colchoneta. \r\nFortalecimiento muscular de de abdominales, extensores de tronco y glúteos. \r\n\',\n  \'diagnostico\' => \'Lumbago no especificado.\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-07\',\n  \'fecha_evaluacion_final\' => \'2017-11-21\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 67 años de edad, con diagnóstico médico de lumbago no especificado de tres semanas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región lumbar de intensidad 2/10 a la palpación y de 6/10 a los movimientos de flexión del tronco según la escala numérica verbal. Presenta espasmos en musculatura paravertebral lumbar y dorsal. Patrones de movimiento del tronco superior buenos por compromiso de la fuerza. A la evaluación de la fuerza muscular del tronco se encuentra nota de 3 para el recto anterior del abdomen, oblicuos mayor y menor derecho e izquierdo y extensores toracolumbares. A la evaluación de la longitud muscular presenta retracciones de la musculatura posterior (paravertebrales lumbares e isquiotibiales), de aductores y del recto anterior del cuádriceps bilateral en la prueba de Thomas. Pruebas de Lasegue y Bragar negativas. El paciente es independiente para todas las actividades de la vida diaria pero presenta dolor que lo limita para levantar un objeto del suelo y amarrarse los zapatos.  \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-10 14:34:16'),(8874,5,'181.58.77.230',1,'persona',123,'Insert persona data:array (\n  \'email\' => \'lalmeyda.cic@gmail.com\',\n  \'movil\' => \'3153361390\',\n  \'genero\' => \'2\',\n  \'barrio\' => \'LA AURORA\',\n  \'telefono\' => \'6457914\',\n  \'direccion\' => \'CR 29 N 33 48 APTO 102\',\n  \'foto_perfil\' => \'63303167.jpg\',\n  \'primer_nombre\' => \'LUZ\',\n  \'segundo_nombre\' => \'MARINA\',\n  \'primer_apellido\' => \'ALMEYDA\',\n  \'segundo_apellido\' => \'VALERO\',\n  \'fecha_nacimiento\' => \'1963-03-09\',\n  \'tipo_identificacion\' => \'2\',\n  \'ciudad\' => \'BUCARAMANGA\',\n  \'numero_identificacion\' => \'63303167\',\n  \'fecha_registro\' => \'2017-11-14 08:22:32\',\n)','2017-11-14 06:22:32'),(8875,5,'181.58.77.230',1,'usuario',125,'Insert usuario data:array (\n  \'id_persona\' => \'123\',\n  \'fecha_registro\' => \'2017-11-14 08:22:32\',\n  \'password\' => \'63303167\',\n  \'loggin\' => \'lalmeyda1\',\n)','2017-11-14 06:22:32'),(8876,5,'181.58.77.230',1,'usuario_perfil_asignado',NULL,'Insert usuario_perfil_asignado data:array (\n  \'id_usuario\' => \'125\',\n  \'id_perfil\' => 2,\n)','2017-11-14 06:22:32'),(8877,5,'181.58.77.230',1,'cliente',117,'Insert cliente data:array (\n  \'eps_prepagada\' => \'SALUDTOTAL EPS Y COLMEDICA\',\n  \'asistencia_medica\' => NULL,\n  \'emergencia_atencion\' => \'clinica chicamocha\',\n  \'emergencia_pariente_movil\' => \'3118870812\',\n  \'emergencia_pariente_nombre\' => \'HERNAN GARNICA\',\n  \'emergencia_pariente_telefono\' => NULL,\n  \'id_persona\' => \'123\',\n  \'fecha_registro\' => \'2017-11-14 08:22:32\',\n)','2017-11-14 06:22:32'),(8878,5,'181.58.77.230',1,'cliente_sub_paquete',322,'Insert cliente_sub_paquete data:array (\n  \'fecha_limite\' => \'2017-11-22 00:00:00\',\n  \'id_sub_paquete\' => \'23\',\n  \'total_pagar\' => \'145000\',\n  \'id_cliente\' => \'117\',\n  \'descuento\' => \'0\',\n  \'fecha_inicio\' => \'2017-11-14\',\n  \'fecha_pago\' => \'2017-11-14\'