icular del tobillo dentro de los valores normales. En la evaluación postural se encuentra en la vista anterior hombro derecho descendido, cadera elevada del lado derecho, leve genu valgo, tibias varas y pies planos; en la vista posterior se corroboran hallazgos encontrados en la vista anterior y adicionalmente posible escoliosis dorsolumbar izquierda. En la vista lateral: hipercifosis cervical, hiperlordosis lumbar, protrucción de hombros y abdominal, hiperextensión de rodillas.\',\n  \'evaluacion_final\' => \'Después de realizadas 3 sesiones de fisioterapia la paciente refiere persistencia del dolor en planta del pie, ausencia de espasmos musculares en región lumbar y de plantiflexores. Por lo anterior se sugiere valoración médica para determinar un diagnóstico y plan de manejo. \',\n  \'sesiones_realizadas\' => \'3.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-20 09:02:38'),(9134,99,'190.13.43.82',2,'cliente_historia_clinica',45,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'MODALIDADES FISICAS\r\nTermoterapia superficial: (Paquete caliente), Termoterapia profunda: Ultrasonido Terapéutico (Modo de aplicación: continuo), Electroterapia: TENS (nivel sensitivo confortable), Masaje sedativo.\r\n\r\nEJERCICIO TERAPÉUTICO\r\nEstiramiento mantenido: Musculatura de cuello, hombro y escapula.\r\nSostener-relajar\r\nIsométricas alternas y estabilizaciones rítmicas. \r\n\',\n  \'diagnostico\' => \'Cervicalgia\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-14\',\n  \'fecha_evaluacion_final\' => \'2017-11-20\',\n  \'evaluacion_inicial\' => \'Paciente de género femenino de 54 años de edad, con diagnóstico médico de cervicalgia de tres meses de evolución.  A la evaluación fisioterapéutica refiere dolor región cervical de intensidad 7/10 a la palpación y de 5/10 cm al movimiento de rotación e inclinación lateral del cuello, según la escala numérica verbal de dolor. Presenta espasmos en fibras superiores y medias del trapecio, paravertebrales cervicales y romboides. A la evaluación de los patrones de movimiento presenta patrones buenos para cabeza y cuello por compromiso de la movilidad por presencia de dolor. A la evaluación de la movilidad articular de la columna cervical se encontró disminución de los movimientos de flexión (0 a 40 grados),  inclinación lateral derecha e izquierda (0 a 40 grados), rotación (0-60 derecha e izquierda). La paciente es independiente en todas las actividades de la vida diaria, pero presenta dolor que la limita durante el uso del computador.\',\n  \'evaluacion_final\' => \'La paciente finaliza tratamiento de fisioterapia después de 5 sesiones. A la revaloración se encuentra disminución del dolor en región cervical de 2/10 a la palpación y al movimiento de inclinación lateral del cuello, según la escala numérica verbal de dolor. Ausencia de espasmos, aumento del rango de movimiento de rotación del cuello (0 a 70 grados) bilateralmente. Disminución de la limitación funcional durante el uso del computador. \',\n  \'sesiones_realizadas\' => \'5.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-21 14:14:05'),(9135,99,'190.13.43.82',2,'cliente_historia_clinica',43,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dra. Erika Margarita Aguirre\',\n  \'plan_tratamiento\' => \'MODALIDADES FISICAS\r\nElectroterapia: TENS (nivel sensitivo confortable), Masaje sedativo, Termoterapia superficial (paquete caliente), Ultrasonido terapéutico (modo: continuo). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPÉUTICO:\r\nEstiramiento muscular mantenido: paravertebrales dorsales y lumbares, isquiotibiales, aductores de cadera, glúteos y musculatura lateral del tronco.\r\nEjercicio Cat-camel, ejercicio de anteversión y retroversión de la pelvis en supino sobre colchoneta. \r\nFortalecimiento muscular de de abdominales, extensores de tronco y glúteos. \r\n\',\n  \'diagnostico\' => \'Lumbago no especificado.\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-07\',\n  \'fecha_evaluacion_final\' => \'2017-11-21\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 67 años de edad, con diagnóstico médico de lumbago no especificado de tres semanas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región lumbar de intensidad 2/10 a la palpación y de 6/10 a los movimientos de flexión del tronco según la escala numérica verbal. Presenta espasmos en musculatura paravertebral lumbar y dorsal. Patrones de movimiento del tronco superior buenos por compromiso de la fuerza. A la evaluación de la fuerza muscular del tronco se encuentra nota de 3 para el recto anterior del abdomen, oblicuos mayor y menor derecho e izquierdo y extensores toracolumbares. A la evaluación de la longitud muscular presenta retracciones de la musculatura posterior (paravertebrales lumbares e isquiotibiales), de aductores y del recto anterior del cuádriceps bilateral en la prueba de Thomas. Pruebas de Lasegue y Bragar negativas. El paciente es independiente para todas las actividades de la vida diaria pero presenta dolor que lo limita para levantar un objeto del suelo y amarrarse los zapatos.  \',\n  \'evaluacion_final\' => \'El paciente finaliza tratamiento de fisioterapia después de 10 sesiones. A la revaloración fisioterapéutica no presenta dolor ni espasmos en región lumbar. Presenta disminución de las retracciones musculares de paravertebrales lumbares, isquiotibiales, de aductores y del recto anterior del cuádriceps bilateralmente. El paciente no presenta limitación para las actividades de la vida diaria. \',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-21 14:14:47'),(9136,99,'190.13.43.82',2,'cliente_historia_clinica',46,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Carlos Hernando Rico\',\n  \'plan_tratamiento\' => NULL,\n  \'diagnostico\' => \'Síndrome del manguito rotador derecho \',\n  \'fecha_evaluacion_inicial\' => \'2017-11-15\',\n  \'fecha_evaluacion_final\' => \'2017-11-29\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 76 años de edad, con diagnóstico médico de síndrome del manguito rotador del hombro derecho. A la evaluación fisioterapéutica inicial no presenta dolor al reposo ni al movimiento del hombro, presenta espasmos en trapecio fibras superiores y medias y bíceps braquial derecho. Se realizan pruebas específicas para hombro: arco doloroso, test de Neer, test de Kennedy Hawkins, maniobra de Jobe y de Patte con resultados negativos. Movilidad articular del hombro dentro de los valores normales: flexión (0°-180°), extensión (0°-50°), abducción (0°-170°), aducción (170°-0°), rotación interna (0°-70°), rotación externa (0°-80°). Patrones de movimiento buenos para el miembro superior izquierdo con mayor compromiso de la fuerza del pivote proximal. Retracciones musculares leves para el pectoral mayor y dorsal ancho bilateral. Presenta notas musculares de 4 para deltoides anterior y posterior, romboides y para rotadores externos del hombro derecho. No presenta imitación funcional ni restricción en la participación en sus roles. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-21 14:16:49'),(9137,99,'190.13.43.82',2,'cliente_historia_clinica',46,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Carlos Hernando Rico\',\n  \'plan_tratamiento\' => \'MODALIDADES FISICAS\r\nTermoterapia superficial (paquete caliente), Electroterapia (TENS nivel sensitivo),  masaje terapéutico.\r\n\r\nMODALIDADES DEL EJERCICIO\r\nEstiramiento  mantenido de los miembros superiores, ejercicios de Codman con mancuerna de 3 lb,  ejercicios de fortalecimiento con mancuernas de 1 y 2 lb para miembros superiores, fortalecimiento de cintura escapular en multifuerza.\',\n  \'diagnostico\' => \'Síndrome del manguito rotador derecho \',\n  \'fecha_evaluacion_inicial\' => \'2017-11-15\',\n  \'fecha_evaluacion_final\' => \'2017-11-29\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 76 años de edad, con diagnóstico médico de síndrome del manguito rotador del hombro derecho. A la evaluación fisioterapéutica inicial no presenta dolor al reposo ni al movimiento del hombro, presenta espasmos en trapecio fibras superiores y medias y bíceps braquial derecho. Se realizan pruebas específicas para hombro: arco doloroso, test de Neer, test de Kennedy Hawkins, maniobra de Jobe y de Patte con resultados negativos. Movilidad articular del hombro dentro de los valores normales: flexión (0°-180°), extensión (0°-50°), abducción (0°-170°), aducción (170°-0°), rotación interna (0°-70°), rotación externa (0°-80°). Patrones de movimiento buenos para el miembro superior izquierdo con mayor compromiso de la fuerza del pivote proximal. Retracciones musculares leves para el pectoral mayor y dorsal ancho bilateral. Presenta notas musculares de 4 para deltoides anterior y posterior, romboides y para rotadores externos del hombro derecho. No presenta imitación funcional ni restricción en la participación en sus roles. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-21 14:19:14'),(9138,5,'181.58.77.230',1,'persona',126,'Insert persona data:array (\n  \'email\' => \'hdezleon720@hotmail.com\',\n  \'movil\' => \'3017426228\',\n  \'genero\' => \'1\',\n  \'barrio\' => \'EL TEJAR\',\n  \'telefono\' => NULL,\n  \'direccion\' => \'AV TRANS ORIENTAL 94-113 TORRE 1 APTO 302\',\n  \'foto_perfil\' => \'91439667.jpg\',\n  \'primer_nombre\' => \'LUIS \',\n  \'segundo_nombre\' => \'ALFONSO\',\n  \'primer_apellido\' => \'HERNANDEZ\',\n  \'segundo_apellido\' => \'LEON\',\n  \'fecha_nacimiento\' => \'1972-12-08\',\n  \'tipo_identificacion\' => \'2\',\n  \'ciudad\' => \'BUCARAMANGA\',\n  \'numero_identificacion\' => \'91439667\',\n  \'fecha_registro\' => \'2017-11-22 19:19:36\',\n)','2017-11-22 17:19:36'),(9139,5,'181.58.77.