manas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del maléolo lateral del tobillo derecho de intensidad 6/10 a la palpación y de 7/10 a los movimientos de inversión y en bipedestación prolongada según la escala numérica verbal. Presenta espasmos en músculos peroneos, tibial anterior y gastronecmios del miembro inferior derecho. Presenta edema de 3 cm de diferencia localizado 4 cm hacia abajo del maléolo lateral izquierdo. Disminución del rango de movimiento de inversión (0°-25°) con sensación final vacío por presencia de dolor. Fuerza muscular de 4 para peroneos y plantiflexores derechos. Retracciones musculares leves de isquiotibiales bilateralmente. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol laboral y recreativo. \',\n  \'evaluacion_final\' => \'El paciente finaliza 10 sesiones de fisioterapia, a la revaloración presenta disminución del dolor en región anterior del maléolo lateral del tobillo derecho de intensidad 3/10 a la palpación y de 4/10 al final del rango de movimiento de inversión, según la escala numérica verbal. No presenta estamos, ni edema. Aumento de la movilidad articular de inversión (0°-35°). Disminución de las retracciones musculares de isquiotibiales bilateralmente. El paciente es independiente para las actividades de la vida diaria, pero presenta leve restricción en la participación en su rol laboral. \',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-23 12:27:03'),(9143,99,'190.184.159.24',2,'cliente_historia_clinica',42,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Caminata en banda sin fin (velocidad 2 km/hr)\r\n\r\nFortalecimiento muscular a través de ejercicios uniplanares con resistencia externa: bandas elásticas (amarilla) y/o equipos de suspensión como TRX o autocargas en cadenas cinética cerrada y abiertas.\r\n\r\nEjercicios de coordinación, propiocepción y balance: desplazamientos en escalerillas, ejercicio de apoyo unipodal sobre superficie estable e inestable, ejercicio de alcance anterior en apoyo unipodal. \r\n\r\nEstiramiento mantenido. \r\n\',\n  \'diagnostico\' => \'Esguince de ligamentos laterales del tobillo derecho\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-02\',\n  \'fecha_evaluacion_final\' => \'2017-11-23\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 37 años de edad, con diagnóstico médico de esguince de ligamentos externos del tobillo derecho de tres semanas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del maléolo lateral del tobillo derecho de intensidad 6/10 a la palpación y de 7/10 a los movimientos de inversión y en bipedestación prolongada según la escala numérica verbal. Presenta espasmos en músculos peroneos, tibial anterior y gastronecmios del miembro inferior derecho. Presenta edema de 3 cm de diferencia localizado 4 cm hacia abajo del maléolo lateral izquierdo. Disminución del rango de movimiento de inversión (0°-25°) con sensación final vacío por presencia de dolor. Fuerza muscular de 4 para peroneos y plantiflexores derechos. Retracciones musculares leves de isquiotibiales bilateralmente. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol laboral y recreativo. \',\n  \'evaluacion_final\' => \'El paciente finaliza 10 sesiones de fisioterapia, a la revaloración presenta disminución del dolor en región anterior del maléolo lateral del tobillo derecho de intensidad 3/10 a la palpación y de 4/10 al final del rango de movimiento de inversión, según la escala numérica verbal. No presenta estamos, ni edema. Aumento de la movilidad articular de inversión (0°-35°). Disminución de las retracciones musculares de isquiotibiales bilateralmente. El paciente es independiente para las actividades de la vida diaria, pero presenta leve restricción en la participación en su rol laboral. \',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-23 12:31:16'),(9144,5,'181.58.77.230',1,'persona',127,'Insert persona data:array (\n  \'email\' => \'xxxxx@xxxxxx.xxx\',\n  \'movil\' => \'3157520033\',\n  \'genero\' => \'2\',\n  \'barrio\' => \'EL PRADO\',\n  \'telefono\' => NULL,\n  \'direccion\' => \'CR 37 N 35 75 PRIMER PISO\',\n  \'foto_perfil\' => \'27913765.jpg\',\n  \'primer_nombre\' => \'ROMELIA\',\n  \'segundo_nombre\' => NULL,\n  \'primer_apellido\' => \'GOMEZ \',\n  \'segundo_apellido\' => \'DE MONCADA\',\n  \'fecha_nacimiento\' => \'1931-03-17\',\n  \'tipo_identificacion\' => \'2\',\n  \'ciudad\' => \'BUCARAMANGA\',\n  \'numero_identificacion\' => \'27913765\',\n  \'fecha_registro\' => \'2017-11-23 15:30:10\',\n)','2017-11-23 13:30:10'),(9145,5,'181.58.77.230',1,'usuario',128,'Insert usuario data:array (\n  \'id_persona\' => \'127\',\n  \'fecha_registro\' => \'2017-11-23 15:30:10\',\n  \'password\' => \'27913765\',\n  \'loggin\' => \'rgomez1\',\n)','2017-11-23 13:30:10'),(9146,5,'181.58.77.230',1,'usuario_perfil_asignado',NULL,'Insert usuario_perfil_asignado data:array (\n  \'id_usuario\' => \'128\',\n  \'id_perfil\' => 2,\n)','2017-11-23 13:30:10'),(9147,5,'181.58.77.230',1,'cliente',120,'Insert cliente data:array (\n  \'eps_prepagada\' => \'COOMEVA PREPAGADA\',\n  \'asistencia_medica\' => \'AME\',\n  \'emergencia_atencion\' => \'clinica bucaramanga\',\n  \'emergencia_pariente_movil\' => \'3163374000\',\n  \'emergencia_pariente_nombre\' => \'RUTH MONCADA\',\n  \'emergencia_pariente_telefono\' => NULL,\n  \'id_persona\' => \'127\',\n  \'fecha_registro\' => \'2017-11-23 15:30:10\',\n)','2017-11-23 13:30:10'),(9148,5,'181.58.77.230',1,'cliente_sub_paquete',328,'Insert cliente_sub_paquete data:array (\n  \'fecha_limite\' => \'2017-12-23 00:00:00\',\n  \'id_sub_paquete\' => \'1\',\n  \'total_pagar\' => \'150000\',\n  \'id_cliente\' =