5,'181.58.77.230',1,'usuario',131,'Insert usuario data:array (\n  \'id_persona\' => \'130\',\n  \'fecha_registro\' => \'2017-11-28 17:01:14\',\n  \'password\' => \'91524660\',\n  \'loggin\' => \'yardila1\',\n)','2017-11-28 15:01:14'),(9270,5,'181.58.77.230',1,'usuario_perfil_asignado',NULL,'Insert usuario_perfil_asignado data:array (\n  \'id_usuario\' => \'131\',\n  \'id_perfil\' => 2,\n)','2017-11-28 15:01:14'),(9271,5,'181.58.77.230',1,'cliente',123,'Insert cliente data:array (\n  \'eps_prepagada\' => \'SURA EPS\',\n  \'asistencia_medica\' => NULL,\n  \'emergencia_atencion\' => \'foscal\',\n  \'emergencia_pariente_movil\' => \'3014494989\',\n  \'emergencia_pariente_nombre\' => \'ADRIANA GOMEZ\',\n  \'emergencia_pariente_telefono\' => NULL,\n  \'id_persona\' => \'130\',\n  \'fecha_registro\' => \'2017-11-28 17:01:14\',\n)','2017-11-28 15:01:14'),(9272,99,'190.13.45.217',2,'cliente_historia_clinica',46,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Carlos Hernando Rico\',\n  \'plan_tratamiento\' => \'MODALIDADES FISICAS\r\nTermoterapia superficial (paquete caliente), Electroterapia (TENS nivel sensitivo),  masaje terapéutico.\r\n\r\nMODALIDADES DEL EJERCICIO\r\nEstiramiento  mantenido de los miembros superiores, ejercicios de Codman con mancuerna de 3 lb,  ejercicios de fortalecimiento con mancuernas de 1 y 2 lb para miembros superiores, fortalecimiento de cintura escapular en multifuerza.\',\n  \'diagnostico\' => \'Síndrome del manguito rotador derecho \',\n  \'fecha_evaluacion_inicial\' => \'2017-11-15\',\n  \'fecha_evaluacion_final\' => \'2017-11-29\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 76 años de edad, con diagnóstico médico de síndrome del manguito rotador del hombro derecho. A la evaluación fisioterapéutica inicial no presenta dolor al reposo ni al movimiento del hombro, presenta espasmos en trapecio fibras superiores y medias y bíceps braquial derecho. Se realizan pruebas específicas para hombro: arco doloroso, test de Neer, test de Kennedy Hawkins, maniobra de Jobe y de Patte con resultados negativos. Movilidad articular del hombro dentro de los valores normales: flexión (0°-180°), extensión (0°-50°), abducción (0°-170°), aducción (170°-0°), rotación interna (0°-70°), rotación externa (0°-80°). Patrones de movimiento buenos para el miembro superior izquierdo con mayor compromiso de la fuerza del pivote proximal. Retracciones musculares leves para el pectoral mayor y dorsal ancho bilateral. Presenta notas musculares de 4 para deltoides anterior y posterior, romboides y para rotadores externos del hombro derecho. No presenta imitación funcional ni restricción en la participación en sus roles. \',\n  \'evaluacion_final\' => \'Paciente finaliza orden de fisioterapia después de 10 sesiones, a la revaloración continua sin dolor, no presenta espasmos musculares, pruebas específicas de hombro con resultados negativos. Movilidad articular conservada. Patrones de movimiento buenos, disminución de retracciones musculares del pectoral mayor y dorsal ancho bilateralmente. No presenta imitación funcional ni restricción en la participación en sus roles.  \',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-29 20:09:16'),(9273,99,'190.13.45.217',2,'cliente_historia_clinica',44,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Nelson Ivan Gonzales \',\n  \'plan_tratamiento\' => \'MODALIDADES FÍSICAS:\r\nUltrasonido terapéutico (pulsado), Crioterapia (criomasaje), Masaje sedativo, Termoterapia superficial (paquete caliente). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPÉUTICO:\r\nEstiramiento muscular mantenido: flexores de muñeca, pronadores, triceps, pectoral.\r\nEstiramientos neurodinamicos\r\n\',\n  \'diagnostico\' => \'Neuropatía focal compresiva del nervio ulnar  bilateral.\',\n  \'fecha_evaluacion_inicial\' => \'2017-11-07\',\n  \'fecha_evaluacion_final\' => \'2017-12-01\',\n  \'evaluacion_inicial\' => \'Paciente de género masculino de 36 años de edad, con diagnóstico médico de neuropatía focal compresiva del nervio ulnar en codo bilateral, de tres meses de evolución.  A la evaluación fisioterapéutica inicial no refiere dolor, presenta parestesias en 4° y 5° dedo bilateralmente. Presenta espasmos en musculatura flexora de muñeca y dedos y bíceps braquial. Rangos de movilidad articular de a muñeca y dedos dentro de los valores normales. A la evaluación de la fuerza no se encuentra alteración. El paciente es independiente en todas las actividades de la vida diaria, pero presenta limitación para el uso del computador y celular. \',\n  \'evaluacion_final\' => \'Paciente finaliza orden de fisioterapia, después de 12 sesiones. A la revaloración refiere disminución de parestesias en 4° y 5° dedo bilateralmente, las cuales son ocasionales. Ausencia de espasmo. Movilidad articular de muñeca y dedos conservada. Fuerza muscular de muñeca y dedos sin compromiso. El paciente es independiente en todas las actividades de la vida diaria, con menor limitación para el uso del computador y celular.\',\n  \'sesiones_realizadas\' => \'12.00\',\n  \'id_representante\' => \'6\',\n)','2017-11-29 20:10:06'),(9274,5,'181.58.77.230',1,'cliente_sub_paquete',332,'Insert cliente_sub_paquete data:array (\n  \'fecha_limite\' => \'2018-01-01 00:00:00\',\n  \'id_sub_paquete\' => \'10\',\n  \'total_pagar\' => \'360000\',\n  \'id_cliente\' => \'8\',\n  \'descuento\' => \'0\',\n  \'fecha_inicio\' => \'2017-12-01\',\n  \'fecha_pago\' => \'2017-12-04\',\n)','2017-12-04 05:00:08'),(9275,5,'181.58.77.230',1,'sesion_sub_paquete',4185,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'332\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-12-04\',\n  \'numero\' => 1,\n)','2017-12-04 05:00:08'),(9276,5,'181.58.77.230',1,'sesion_sub_paquete',4186,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'332\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-12-04\',\n  \'num