umbares y glúteo de predominio derecho, inflamación marcada en dicha zona, limitación de la movilidad para la flexión y extensión del tronco, retracciones leves de isquiotibiales, plantiflexores, tensor de la fascia lata y rotadores externos de cadera, de predominio derecho, debilidad de musculatura paravertebral dorsal y abdominal.\r\nEn la valoración postural se observa descenso de hombro izquierdo, ascenso de cadera derecha, lo que indica posible escoliosis dorsal derecha y compensada lumbar izquierda, marcada hiperlordosis lumbar y leve protrucción abdominal.\r\nLlega al servicio con marcha antálgica y gran dificultad para realizar cambios de postura.\',\n  \'evaluacion_final\' => \'Desde el punto de vista de la valoración Fisioterapéutica se recomienda seguir con fisioterapia y cuidados posturales: No levantar objetos pesados, no trabajar en posturas extremas por largo tiempo, realizar pausas activas durante su trabajo y evitar movimientos de rotación del tronco.\',\n  \'sesiones_realizadas\' => \'1.00\',\n  \'id_representante\' => \'2\',\n  \'fecha_registro\' => \'2017-12-21 18:38:14\',\n  \'id_cliente\' => \'125\',\n)','2017-12-21 16:38:14'),(9802,5,'181.58.77.230',1,'persona',134,'Insert persona data:array (\n  \'email\' => \'alejandrotello@gmail.com\',\n  \'movil\' => \'3164718278\',\n  \'genero\' => \'1\',\n  \'barrio\' => \'CAÑAVERAL\',\n  \'telefono\' => \'6392929\',\n  \'direccion\' => \'CIRCUNV 29 N 22 70 \',\n  \'foto_perfil\' => \'91226693.jpg\',\n  \'primer_nombre\' => \'ALEJANDRO\',\n  \'segundo_nombre\' => NULL,\n  \'primer_apellido\' => \'TELLO\',\n  \'segundo_apellido\' => NULL,\n  \'fecha_nacimiento\' => \'1963-07-25\',\n  \'tipo_identificacion\' => \'2\',\n  \'ciudad\' => \'FLORIDABLANCA\',\n  \'numero_identificacion\' => \'91226693\',\n  \'fecha_registro\' => \'2017-12-27 16:49:52\',\n)','2017-12-27 14:49:52'),(9803,5,'181.58.77.230',1,'usuario',135,'Insert usuario data:array (\n  \'id_persona\' => \'134\',\n  \'fecha_registro\' => \'2017-12-