/*Table structure for table `cliente_historia_clinica` */

DROP TABLE IF EXISTS `cliente_historia_clinica`;

CREATE TABLE `cliente_historia_clinica` (
  `id_cliente_historia_clinica` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id de la historia clinica',
  `id_cliente` int(11) unsigned NOT NULL COMMENT 'Id del cliente',
  `fecha_registro` datetime NOT NULL COMMENT 'Fecha de registro',
  `remitido_por` text COLLATE utf8_unicode_ci COMMENT 'Remitido por',
  `sesiones_realizadas` int(10) unsigned DEFAULT NULL COMMENT 'numero de sesiones realizadas',
  `fecha_evaluacion_inicial` date DEFAULT NULL COMMENT 'fecha de evaluacion inicial',
  `evaluacion_inicial` text COLLATE utf8_unicode_ci COMMENT 'Evaluación inicial',
  `plan_tratamiento` text COLLATE utf8_unicode_ci COMMENT 'Plan de tratamiento',
  `diagnostico` text COLLATE utf8_unicode_ci COMMENT 'Diagnóstico',
  `fecha_evaluacion_final` date DEFAULT NULL COMMENT 'fecha de evaluacion final',
  `evaluacion_final` text COLLATE utf8_unicode_ci COMMENT 'Evaluación final',
  `id_representante` int(20) unsigned DEFAULT NULL COMMENT 'id del representante',
  PRIMARY KEY (`id_cliente_historia_clinica`),
  KEY `id_cliente_cliente_historia_clinica_idx` (`id_cliente`),
  KEY `id_representante_cliente_historia_clinica_idx` (`id_representante`),
  CONSTRAINT `id_cliente_cliente_historia_clinica_fk` FOREIGN KEY (`id_cliente`) REFERENCES `cliente` (`id_cliente`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `id_representante_cliente_historia_clinica_fk` FOREIGN KEY (`id_representante`) REFERENCES `rh_representante` (`id_representante`)
