insert  into `cliente_historia_clinica`(`id_cliente_historia_clinica`,`id_cliente`,`fecha_registro`,`remitido_por`,`sesiones_realizadas`,`fecha_evaluacion_inicial`,`evaluacion_inicial`,`plan_tratamiento`,`diagnostico`,`fecha_evaluacion_final`,`evaluacion_final`,`id_representante`) values (1,14,'2017-02-02 09:23:20','Dr. Hector Garcia',10,'2017-01-26','Paciente de genero femenino, de 23 años de edad con diagnostico medico de mamoplastia de 400cc hace aproximadamente 5 meses de evolución (realizada el 5 de octubre). Quien presenta dolor en la zona mamaria bilateral de 5/10 al movimiento  de flexion de hombro de 2/10 a la palpación  y de 1/10 al reposo que le limitan al realizar actividades de la vida diaria como peinarse y al realizar alcances por encima de la cabeza. presenta retracciones del pectoral mayor y menor bilateralmente y espasmos en mismo musculo y trapecio fibras superiores. se observa edema en zona infraclavicular izquierda. presenta patrones de movimiento buenos para MMSS por disminución del rango de movimiento (flexion de hombro de 0-140° y abd de 0-160° bilateral). Lo anterior le limita las actividades de la vida diaria y su participación en su rol estudiantil.','-Crioterapia, masaje con hielo durante 12 minutos.\r\n\r\n-masaje sedativo en zonas de espasmos y masaje de drenaje en zona infraclavicular y esternal izquierda.\r\n\r\n-TENS de intensidad sensitivo en zona de espasmos.\r\n\r\n-Estiramiento mantenido para pectoral mayor y menor bilateral.\r\n\r\n- TFNP, sostener- relajar para pectoral mayor.\r\n     Isometricas alternas para cabeza y cuello.\r\n\r\n- Ejercicios de fortalecimiento con resistencia manual y externa en diagonales de movimiento.','Procedimiento estetico; Mamoplastia','2017-02-09','Paciente de género femenino, de 23 años de edad con diagnóstico médico de mamoplastia de 400cc hace aproximadamente 5 meses de evolución (realizada el 5 de octubre). Quien después de 10 sesiones de fisioterapia presenta  disminución del dolor en la zona mamaria bilateral de 1/10 al movimiento  de flexión de hombro de 1/10 a la palpación  y de 0/10 al reposo no le limita para realizar ninguna actividad. No presenta retracciones del pectoral mayor ni menor y espasmos en  presenta disminución de los espasmos en musculo trapecio fibras superiores y del pectoral mayor bilateralmente. No se observa edema en zona infraclavicular izquierda. Presenta patrones de movimiento buenos y rangos de movimiento normales en MMSS. No presenta restricción en la participación de ninguno de sus roles.',NULL),(2,21,'2017-02-02 18:38:29','Dr. Elio David Rueda Cadena',32,'2017-02-01','Paciente de genero femenino, de 50 años de edad con diagnostico medico de lesiòn de menisco derecho por lo que se le realizò artroscopia el 21 de enero de 2017. Ingresa al servicio de fisioterapia realizando marcha de tres puntos con muletas de manera inadecuada. Presenta dolor en rodilla derecha de 7/10 al reposo y al movimiento de flexión y extensión de rodilla. Edema de 4cm en rodilla respecto al otro miembro y espasmos musculares en cuadriceps femoral, tibial anterior y peroneos bilateral. Disminución del rango de movimiento para la flexiòn de rodilla derecha de 0-90° y  alteración de los patrones de movimiento para miembro inferior derecho siendo malos por restricción en las descargas de peso. Lo anterior la limita en las actividades de la vida diaria y su participación en su rol laboral.','- Crioterapia, masaje con hielo en zona de edema.\r\n\r\n-Masaje sedativo en miembros inferiores y masaje de drenaje en miembro inferior derecho.\r\n\r\n-Tens nivel sensitivo en miembro inferior derecho.\r\n\r\n- Termoterapia, paquete caliente en miembro inferior izquierdo.\r\n\r\n- Ejercicios de cadena cinética cerrada con balón terapéutico.\r\n\r\n- Ejercicios activo-asistidos en diagonales de movimiento.\r\n\r\n-Entrenamiento funcional, reeducación de la marcha en tres puntos.\r\n\r\n-Ultrasonido pulsado, de 1HZ, durante 7 minutos en rodilla derecha.\r\n\r\n- Trabajo de reducación de la marcha en banda sin fin y superficie irregular como colchoneta.\r\n\r\n-Ejercicios de fortalecimiento del core.\r\n\r\n-Trabajo en bicicleta estática tipo recumbent.\r\n\r\n-Ejercicios de coordinación y balance alcances anteriores con cono y balón.\r\n\r\n-Ejercicios de fortalecimiento con resistencia externa, multifuerza y sentadillas con balón.\r\n\r\n-Trabajo de balance y propiocepciòn en superficie inestable (bosu).\r\n\r\n-Trabajo con TRX.\r\n\r\n-Estiramiento mantenido.','Fractura de menisco y Artroscopia derecha de 7 semanas de evolución','2017-03-21','A la revaloración terapéutica después de 32 sesiones de fisioterapia la paciente realiza marcha de forma independiente con todas las fases, subfases y determinantes de la marcha. Presenta dolor en rodilla derecha de 2/10 al reposo y al movimiento de flexión y extensión de rodilla. No presenta edema, pero si espasmos en aductores de cadera bilateral. Se encuentran retracciones musculares del recto anterior del cuadriceps en miembro inferior derecho y retracción de isquiotibiales de forma bilateral. Presenta disminución del rango de movimiento en rodilla derecha de 0-130° con sensación final duro-elástico.  No hay alteración de los patrones de movimiento  pero si leve alteración de la propiocepción y el balance teniendo un apoyo unipodal en superficie inestable (bosu) para miembro inferior derecho de 12s y de 17s para el miembro inferior izquierdo. Lo anterior no le produce alteración de la funcionalidad ni restricción en ninguno de sus roles.',3),(3,25,'2017-02-03 18:49:32','Dra. Erika Tatiana Mantilla Orozco',10,'2017-01-30','Paciente de genero femenino, de 58 años de edad quien ingresa al servicio con el MSD adosado al cuerpo.  Presenta dolor de 8/10 al movimiento de flexión, abducción y rotación de hombro, presenta espasmos fibras superiores del trapecio bilateral, supraespinoso, infraespinoso y bíceps braquial derecho, disminución del rango de movimiento para la flexión y abd de hombro derecho de 160°, Disminución generalizada de la fuerza de hombro derecho. Presenta patrón de movimiento regular para MSD por disminución del rango de movimiento, de la fuerza y alteración en la funcionalidad. A la evaluación de las pruebas especificas de hombro presenta positivas hawkins y kennedy, maniobra de hobe speed y patte. no se realizan pruebas de longitud muscular por presencia de dolor. Lo anterior altera sus actividades de la vida diaria y su participación en su rol laboral.','Crioterapia, masaje con hielo.\r\n\r\nTermoterapia, paquete caliente en musculatura de manguito rotador.\r\n\r\nTens nivel sensitivo.\r\n\r\nUltrasonido pulsado con objetivo de reparar tejido lesionado.\r\n\r\nMasaje sedativo dirigido a espasmos musculares.\r\n\r\nAproximaciones y tracciones articulares suaves.\r\nEjercicios de codman.\r\n\r\nTFNP, isometicas alternas y estabilizacion ritmica en cintura escapular y MMSS','Tendinitis del subraespinoso e infraespinoso\r\nTenosinovitis de la cabeza larga del biceps braquial\r\nArtrosis acromioclavicular','2017-02-10','Paciente de genero femenino, de 58 años de edad quien ingresa al servicio con el MSD adosado al cuerpo.  Presenta disminucion del dolor de 6/10 al movimiento de flexión, abducción y rotación de hombro, presenta disminucion de espasmos en fibras superiores del trapecio bilateral, supraespinoso, infraespinoso y bíceps braquial derecho, aumento su del rango de movimiento para la flexión y abd de hombro derecho de  0-170° aunque aun presenta dolor a la mitad del rango, Presenta patrón de movimiento regular para MSD por disminución del rango de movimiento, de la fuerza y alteración en la funcionalidad. Lo anterior altera sus actividades de la vida diaria y su participación en su rol laboral.',3),(4,26,'2017-02-07 19:00:37','Eps Ecopetrol',10,'2017-02-02','Paciente de genero masculino, de 59 años de edad con diagnostico medico de hernia disca de L4-L5 y L5-S1que ingresa al servicio de fisioterapia de manera independiente. presenta dolor en la zona lumbar de 8/10 que le limita a las actividades de ascenso y descenso de escaleras. presenta espasmos en musculatura paravertebral lumbar y gluteos bilateral, retacciones de isquiotibiales de 60° bilateral evaluado con la prueba 90-90 y disminucion de la movilidad de la columna lumbar para la flexion de 2cm de movilidad. Presenta patrones de movimiento regulares de tronco superior e inferior y disminucion de la fuerza abdominal (3). lo anterior le limita las actividades de la vida diaria y su rol laboral.','Crioterapia, masaje con hielo en zona lumbar\r\nTermoterapia paquete caliente.\r\nTENS nivel sensitivo.\r\nUltrasonido continuo de 1Hz a 0.5 potencia.\r\nMasaje sedativo en zona lumbar y glutea.\r\nEjercicios de fortalecimiento abdominal en patrones y uniplanares.\r\nTFNP isometricas alternas y estabilizacion ritmica para tronco inferior.\r\nestiramiento mantenido y TFNP como so-R para isquiotibiales.','Hernia discal L4-L5 y L5- S1.','2017-02-09',NULL,3),(5,7,'2017-02-09 09:36:57','Rodol Perez Gomez',NULL,'2017-02-09','Una explosión se reportó alrededor de las 10:36 a.m. en el centro de Bogotá, sobre la calle 27 con carrera 4ª, en el barrio La Macarena, junto a la Plaza de Toros La Santamaría.\r\n\r\nSegún información de las autoridades, hay reporte preliminar de 10 uniformados lesionados. Testigos en el punto hablan de más personas afectadas por el estallido. En la edificación Torres del Parque se ven vidrios rotos en los apartamentos.\r\n\r\nEn las inmediaciones de La Santamaría, había un gran dispositivo policial debido a que este  domingo se va a celebrar la última corrida de la temporada taurina en la capital.\r\n\r\nLa emergencia es atendida por las estaciones de Bomberos del Centro Histórico y por la Secretaría de Salud. Las autoridades acordonaron la zona y evacuaron a los heridos.','Una explosión se reportó alrededor de las 10:36 a.m. en el centro de Bogotá, sobre la calle 27 con carrera 4ª, en el barrio La Macarena, junto a la Plaza 