corrida de la temporada taurina en la capital.\r\n\r\nLa emergencia es atendida por las estaciones de Bomberos del Centro Histórico y por la Secretaría de Salud. Las autoridades acordonaron la zona y evacuaron a los heridos.',3),(6,29,'2017-02-19 21:36:35','Particular',5,'2017-02-10','Paciente de genero masculino, quien ingresa al servicio de fisioterapia realizando marcha en muletas. presenta dolor en zona lateral de la rodilla de 8/10 al movimiento de flexión de rodilla. presenta espasmos en aductores de cadera bilateral y tibial derecho. presenta edema de 2cm en rodilla derecha respecto a rodilla izquierda sin signo de fovea. No presenta alteración de la sensibilidad. A la valoración de la movilidad articular presenta movilidad de 0-70° de flexión de rodilla derecha y dorsiflexion de -30°. Disminución de la fuerza en MID; en cuadriceps de 2 y demás musculatura notas de -3. presenta patrones de movimiento buenos para MII y malos para MID. Lo anterior le altera las actividades de la vida diaria y  limita su rol laboral y personal.','Crioterapia, masaje con hielo.\r\nTENS, nivel sensitivo.\r\nTermoterapia paquete caliente.\r\nMasaje de drenaje y sedativo.\r\nEjercicios de rango de movimiento asistido en diagonales y uniplanar\r\nTFNP. So-R dirigido a cuadriceps derecho.\r\nIsometricas alternas y estibilizacion ritimica\r\nEjercicios en cadena cinetica frenada\r\nEstiramiento pasivo.\r\n','Fractura de femur izquierdo','2017-02-16','Paciente de genero masculino, quien a la revaloracion presenta disminucion del dolor en zona lateral de la rodilla de 7/10 al movimiento de flexión de rodilla. presenta disminucion de espasmos en aductores de cadera bilateral y tibial derecho. Presenta disminución del edema de 1,5cm en rodilla derecha respecto a rodilla izquierda sin signo de fovea. A la revaloración de la movilidad articular presenta movilidad de 0-80° de flexión de rodilla derecha y dorsiflexion de -30°. presenta patrones de movimiento buenos para MII y malos para MID. Lo anterior le altera las actividades de la vida diaria y  limita su rol laboral y personal',3),(7,30,'2017-02-19 21:49:47','Particular',10,'2017-02-14','Paciente de genero masculino, quien ingresa de manera independiente al servicio de fisioterapia. A la valoración el paciente presenta dolor de 5/10 al final del rango de inversión de cuello de pie izquierdo. Presenta espasmos en tibial anterior bilateral y gastrocnemios bilateral. Edema a nivel de maléolo lateral izquierdo de 2cm respecto al derecho evaluado con perimetria. Presenta alteración de la propiocepcion y el balance en miembro inferior izquierdo teniendo un apoyo unipodal de 10seg en superficie regular. No presenta disminución del rango de movimiento ni de la fuerza muscular. Se encuentran  patrones de movimiento buenos para miembro inferior izquierdo y normales para miembro inferior derecho. No presenta alteración en la funcionalidad pero si limita su rol deportivo.','Crioterapia, masaje con hielo.\r\nTENS, nivel sensitivo.\r\nUltrasonido, pulsado nivel 6 durante 5 minutos.\r\nMasaje de drenaje y sedativo.\r\nEjercicios de fortalecimiento muscular.\r\nEjercicios de estimulacion propioceptiva en bases inestables como bosu\r\nTRX enfatizado en apoyo y propiocepción.\r\nEstiramiento mantenido.\r\n','Esguince de cuello de pie izquierdo de 8 semanas de evolución.','2017-03-02','A la revaloración el paciente presenta dolor de 2/10 al final del rango de inversión de cuello de pie izquierdo. Se disminuyeron los espasmos en tibial anterior bilateral y gastrocnemios bilateral. No presenta edema en MMII ni signo de fovea . Persiste leve alteración de la propiocepcion y el balance en miembro inferior izquierdo teniendo un apoyo unipodal de 30 seg en superficie inestable (bosu). se conservan rangos de movimiento y fuerza muscular. Los patrones de movimiento son buenos para miembro inferior izquierdo y normales para el derecho. No hay limitación funcional y retomó su actividad deportiva (golf).',3),(8,32,'2017-02-21 17:37:55','Dr.  Jaime Villamizar ',5,'2017-02-20','Paciente de genero femenino en buenas condiciones, con antecedentes de cirugia a corazón abierto hace 3 años con implantacion de stent ,quien ingresa al servicio de fisioterapia de manera independiente. A la valoracion inicial la paciente presenta dolor en cara postero-medial del hombro  izquierdo de 8/10 al movimiento de flexión y abd de hombro y a la palpacion, presenta espasmos en fibras supraespinoso, romboideos y deltoides izquierdo, presenta disminucion del rango de movimiento para la flexion 0 -90°,abd 0-70° y rotaciones de 0-30° con de hombro izquierdo todos con sensacion final vacio, presenta patrón  de movimiento malo para MSI. No se realizan pruebas especificas de hombro por presencia exacerbada de dolor. Todo lo anterior le limita sus actividades de la vida diaria, y le restringe su rol personal y recreativo.','Por antecedentes de cirugia cardiaca e implantacion de stent no se hace uso de ultrasonido ni TENS.\r\n\r\nCrioterapia, masaje con hielo.\r\nTermoterapia, paquete caliente.\r\nMasaje sedativo.\r\nEjercicios en CCC asistidos\r\nEjercicios de rango de movimiento pasivos y asistidos.\r\nEjercicios isometricos.\r\n','Rotura total de musculo supraespinoso izquierdo\r\nTendinitis del musculo infraespinoso izquierdo\r\nTenosinovistis del musculo biceps braquial izquierdo','2017-02-24','A la revaloracion la paciente presenta dolor en cara postero-medial del hombro  izquierdo de 6/10 al movimiento de flexión y abd de hombro y a la palpación, presenta disminución de espasmos en fibras supraespinoso, romboideos y deltoides izquierdo, presenta aumento en el rango de movimiento para la flexión 0 -140°,abd 0-120° y rotaciones para la rotación interna de 0-60°, sigue presentando disminución para la rotación externa de 0-30° con sensación final vacío, presenta patrón  de movimiento malo para MSI. A la valoración muscular presenta contracciones débiles para todos los grupos musculares del hombro y contracciones fuertes para flexores y extensores de codo izquierdo.\r\nTodo lo anterior le sigue limitando sus actividades de la vida diaria, y le restringe su rol personal y recreativo.',3),(9,31,'2017-02-21 18:08:21','Particular',10,'2017-02-16','Paciente de genero masculino en buenas condiciones quien ingresa al servicio de fisioterapia de manera independiente. A la evaluación fisioterapeutica presenta dolor en hombro derecho de 8/10 al movimiento de flexión y abd de hombro. presenta espasmos en musculo trapecio fibras superiores, romboides, pectoral mayor y deltoides derecho.Presenta retracciones en musculo pectoral mayor y menor bilateral y limitación de la movilidad articular de hombro derecho para la flexión y la abd de 0-160° con sensación final vacío. presenta patrones de movimientos buenos para MSD y normales para MSI. A la exploración de pruebas especificas de hombro presenta positivas hawkins y kennedy, neer, speed, arco doloroso, yegarson, jobe y yocum. lo anterior limita sus actividades de la vida diaria y su participación en su rol laboral.','crioterapia, masaje con hielo.\r\nTermoterapia, paquete caliente.\r\nTENS, nivel sensitivo. \r\nUltrasonido Pulsado a 1mHz.\r\nmasaje sedativo.\r\ndeslizamiento neural\r\nEjercicios Isometricos\r\nTFNP, isometricas alternas y estabilizacion ritmica.\r\nejercicios de rango de movimiento activos y asistidos al final del rango.\r\nTracciones.\r\nEstiramiento mantenido','Dolor de hombro izquierdo.','2017-02-03','A la revaloración no presenta disminución de dolor en hombro derecho al movimiento de flexión y abd de hombro. Presenta disminución de espasmos en musculo trapecio fibras superiores, romboides, pectoral mayor derecho y aun presenta en deltoides derecho. Presenta disminución de retracciones en pectorales y aun presenta limitación de movilidad articular de hombro derecho para la flexión y la abd de 0-160° con sensación final vacío. presenta patrones de movimientos buenos para MSD. A la exploración de pruebas especificas de hombro presenta positivas hawkins y kenedy, neer, speed, arco doloroso, jobe, negativas yegarson y yocum. lo anterior limita sus actividades de la vida diaria y su participación en su rol laboral.',3),(10,41,'2017-03-22 09:03:03','Dr. Hugo Alejandro Fernandez',9,'2017-03-21','Paciente de genero masculino que ingresa al servicio de fisioterapia realizando marcha de manera independiente. A la valoración inicial el paciente presenta dolor en cadera derecha de 5/10 a la palpación y de 7/10 al movimiento de flexión y extensión de cadera que le limita al subir y bajar escaleras.  Se palpan espasmos en musculatura pelvitrocanterea, glúteo mayor y medio del lado derecho y se observan retracciones musculares del tensor de la fascia lata y glúteo derecho e isquiotibiales y recto anterior del cuadriceps bilateral. Presenta disminución del rango de movimiento en cadera derecha para la flexión de 0-130° y de rodilla de 0-120° bilateral con sensación final duro-elástico. Presenta patrones de movimiento buenos para miembros inferiores. lo anterior no altera su funcionalidad, pero si restringe su rol deportivo.','-Crioterapia, masaje con hielo durante 5 minutos.\r\n\r\n-Tens nivel sensitivo durante 10 minutos.\r\n\r\n-Termoterapia, paquete caliente.\r\n\r\n-Ultrasonido pulsado de 1Hz durante 5 minutos.\r\n\r\n-Masaje sedativo dirigido musculatura con espasmos.\r\n\r\n-TFNP. isometricas alternas y estabilizacion ritmica en posicion de puente y supino con rodillas flexionadas.\r\n\r\n-Sostener relajar para recto anterior del cuadriceps.\r\n\r\n-Estiramiento mantenido.\r\n\r\n\r\n\r\n\r\n','Tendinitis del glúteo derecho','2017-03-31','A la revaloración el paciente presenta dolor en cadera derecha de 2/10 a la palpación y de 3/10 al movimiento de flexión y extensión de cadera que le limita al subir y bajar escaleras.  Se disminuyeron espasmos en musculatura pelvitrocanterea, glúteo mayor y medio del lado derecho y mejoras en la longitud muscular del tensor de la fascia lata y glúteo derecho e isquiotibiales y recto anterior del cuadriceps bilateral. se observa aumento del rango de movimiento en cadera derecha para la flexión de 0-140° y de rodilla de 0-130° bilateral con sensación final duro-elástico. Presenta patrones de movimiento buenos para miembros inferiores. lo anterior no altera su funcionalidad, pero si restringe su rol deportivo.',3),(11,42,'2017-03-23 18:19:06','Dr. Juan Camilo Mantilla',5,'2017-03-21','Paciente de genero femenino que ingresa al servicio de fisioterapia realizando marcha de manera independiente. A la valoración fisioterapeutica presenta dolor en maleolo externo de 7/10 al movimiento de inversión del pie, de 7/10 a la palpación y de 5/10 al reposo. Se palpan espasmos en tibial anterior derecho y gastrocnemios bilateral, se evidencia edema en maleolo derecho respecto al izquierdo,  la movilidad articular en cuello de pie e encuentra conservada. Presenta patrones de movimientos buenos para miembro inferior derecho y normales para miembro inferior izquierdo, se observa alteración de la propiocepcion y el balance teniendo en apoyo unipodal derecho 18seg e izquierdo 26seg.  Lo anterior no limita su funcionalidad pero si restringe su participacion en su rol deportivo.','- Crioterapia, masaje con hielo durante 5 minutos.\r\n-Tens, nivel sensitivo.\r\n-Masaje de drenaje y sedativo.\r\n-Ejercicios de fortalecimiento con resistencia externa y manual.\r\n-Ejercicios de propiocepcion y balance en colchoneta y bosu.\r\n-Alcances anteriores con balon y cono.\r\n-Ejercicios en Trx.\r\n-Marcha en punta de pies y sobre talones en superficie inestable (colchoneta).\r\n-Sentadillas con Balon de bobath.\r\n-Fortalecimientos de evertores con balón de peso\r\n','Inestabilidad de tobillo derecho por esguince antiguo','2017-03-27','A la revaloracion la paciente presenta dolor en maleolo externo de 3/10 al movimiento de inversión del pie, de 4/10 a la palpación y de 0/10 al reposo. Se disminuyeron espasmos en tibial anterior derecho y persisten en g