NS,  paquete caliente), masaje y estiramiento pasivo ','Lumbago con ciática ','1969-12-31',NULL,2),(36,104,'2017-10-11 21:34:39','Particular ',9,'2017-10-09','Paciente que ingresa al servicio de fisioterapia con diagnostico  médico ya mencionado con 6 meses de evolución. A la valoración inicial observamos prominencias oseas normales, espasmos musculares sobre elevador de la escapula, supraespinoso, trapecio fibras superiores y fibras medias, terete mayor y menor y dorsal ancho, dolor de 5/10 a la palpación en trapecios, supraespinoso, teretes, dorsal ancho, dolor al  8/10 al movimiento activo de flexo-extensión, abducción y aducción según escala análoga del dolor,fuerza muscular de 4/5 por antalgia,  con arcos de movilidad limitados por antalgia.\r\nDificultándole sus actividades de la vida diaria y básicas cotidiana ( vestirse y trabajar).','Modalidades físicas (crioterapia, ultrasonido, TENS, paquete caliente) masaje sedativo, sostener-relajar, estiramiento mantenido de cabeza y cuello, hombro, y región dorsal y lumbar. ','Síndrome abducción dolorosa del hombro, escoliosis dorsal derecha. ','2017-10-26','Paciente de género femenino de 40 años de edad con diagnóstico médico de síndrome de arco doloroso y escoliosis dorsal derecha. Quien finaliza tratamiento de fisioterapia después de 9 sesiones, a la revaloración persiste dolor de intensidad 2/10 a los movimientos abducción del hombro más allá de los 120° y la inclinación lateral del cuello según la escala numérica verbal de dolor, ausencia de espasmos en escapula y hombro, espasmos leves en trapecio superior derecho, se evidencia mejoría en los arcos de movilidad articular del hombro derecho. Presenta menor dificultad para realizar las actividades de vestido y aseo personal. ',2),(37,50,'2017-10-12 11:09:49','Particular',10,'2017-10-11','Paciente de género masculino de 12 años de edad, con diagnóstico médico de fractura del astrágalo secundaria a trauma torsional del tobillo izquierdo durante práctica deportiva (futbol), quien recibió inmovilización con férula de yeso durante 21 días. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del cuello del pie izquierdo de intensidad 3/10  a la palpación y de 1/10 a los movimientos de plantiflexión y dorsiflexión según la escala numérica verbal de dolor. Presenta espasmos en músculos tibial anterior y gastrocnemios del miembro inferior izquierdo. Edema de 2 cm de diferencia localizado 4 cm por debajo del maléolo lateral izquierdo. Rangos de movilidad articular dentro de los valores normales. Fuerza muscular de 5 para el tibial anterior y posterior, peroneos y de 4 para plantiflexores del miembro inferior derecho, no evaluados en el izquierdo por dolor. Retracciones musculares leves de gastrocnemios, isquiotibiales, recto anterior del cuádriceps bilateralmente. Patrón de marcha asimétrico por presencia de mayor toma de peso en el miembro inferior derecho, disminución del choque de talón del miembro inferior izquierdo y mayor apoyo en el borde externo del pie. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol deportivo y recreativo. ','Modalidades físicas: \r\nCrioterapia (criomasaje) Electroterapia (TENS nivel sensitivo), Masaje sedativo, Termoterapia superficial (paquete caliente).\r\n\r\nEjercicio terapéutico:\r\nCaminata en banda sin fin, Ejercicios en trx, Ejercicios de coordinación, propiocepción y balance, ejercicios funcionales para fortalecimiento de los miembros inferiores, Estiramiento mantenido. \r\n\r\n','Fractura del astrágalo Vs Tuberculo de Stieda ','2017-10-26','Paciente de género masculino de 12 años de edad, con diagnóstico médico de fractura del astrágalo secundaria a trauma torsional del tobillo izquierdo durante práctica deportiva (futbol), quien recibió inmovilización con férula de yeso durante 21 días. Finaliza tratamiento de fisioterapia después de 10 sesiones, a la revaloración no presenta dolor ni espasmos musculares, ausencia de edema en tobillo izquierdo. Se valora mejoría en la longitud muscular en gastrocnemios, isquiotibiales y recto anterior del cuadriceps bilateral. Presenta mejoría en la propiocepción y balance del tobillo izquierdo, simetría en la toma de peso de los dos miembros inferiores durante el patrón de marcha. El paciente es independiente para las actividades de la vida diaria, pero presenta leve restricción en la participación en su rol deportivo. ',6),(38,99,'2017-10-13 07:34:11','Dr Carlos Hernando Rico',NULL,'2017-09-29','Paciente de 68 años con diagnóstico médico de lumbago no especificado de 1 mes de evolución, con dolor de 10/10 en la EAV a nivel lumbar, cadera, zona inguinal y cresta iliaca anterosuperior de predominio izquierdo. espasmos severos en paravertebrales lumbares, glúteos, flexores de cadera, tensor de fascia lata y cuádiceps izquierdos, retracciones moderadas de lumbares bajos, isquiotibiales, plantiflexores y abductores de cadera bilateral. Fuerza muscular 4/5 en tronco y miembros inferiores. En la postura se observa leve ascenso de hombro derecho y ascenso de cadera izquierda lo que puede indicar una escoliosis dorsal izquierda y lumbar derecha; hiperlordosis cervical y lumbar e hipercifosis dorsal, protrucción de hombros y abdominal.\r\nEl dolor limita todas sus AVD como dormir, caminar y realizar su ejercicio en el gimnasio.','- Criomasaje en toda la zona afectada.\r\n- Calor local.\r\n- Corriente tipo TENS modulada en zona afectada.\r\n- Ultrasonido pulsado en cadera y glúteo izquierdos.\r\n- Masaje terapéutico de relajación en zona lumbar y miembro inferior izquierdo.\r\n- TFNP: sostener - relajar, isometricas alternas, estabilización rítmica.\r\n- Estiramientos pasivos generales.\r\n- Reeducación postural global.\r\n- Recomendaciones caseras.\r\n','Lumbago no especificado','2017-10-14','Finalizadas las 10 sesiones ordenadas se encuentra que el dolor disminuyó a 3/ 10 en la EAV a nivel glúteo y paraespinal lumbar y es de 7/10 a nivel de cadera y espina iliaca anterosuperior izquierdas. los espasmos desaparecieron en pierna y cadera izquierda y persisten leves en glúteo derecho. Disminuyeron levemente las retracciones. Se conserva la fuerza muscular. Manifiesta que el dolor aun limita algunas de sus AVD como dormir y caminar varias cuadras. Se dieron indicaciones de ejercicios y cuidados caseros.',2),(39,109,'2017-10-27 13:48:25','Dr Juan Camilo Mantilla',10,'2017-10-24','Paciente de género masculino de 10 años de edad, con diagnóstico médico de esguince recidivante de ligamentos externos del tobillo izquierdo de un año de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del maléolo lateral del tobillo izquierdo de intensidad 8/10 a la palpación y de 5/10 a los movimientos de inversión y durante la actividad deportiva (futbol) según la escala numérica verbal. Presenta espasmos en músculos peroneos y gastronecmios del miembro inferior izquierdo. Mediante la medición perimétrica no se encuentran diferencias significativas para edema en el miembro inferior izquierdo. A la movilización pasiva del pie se observa aumento de la laxitud ligamentosa y prueba de inversión forzada positiva. A la evaluación de la fuerza muscular del tobillo y pie se encuentras notas de 4 para peroneos anterior, largo y corto, para el flexor largo y corto del hallux del miembro inferior izquierdo y para los plantiflexores del miembro inferior derecho y de 3 para plantiflexores del miembro inferior izquierdo por dolor. Retracciones musculares leves de gastronecmios e isquiotibiales, bilateralmente. Patrón de marcha asimétrico por presencia de mayor toma de peso en el miembro inferior derecho, disminución del choque de talón izquierdo. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol deportivo y recreativo. ','MODALIDADES FISICAS\r\nCrioterapia (criomasaje), Electroterapia: TENS Modo ALT-TENS (nivel motor confortable), Masaje sedativo, Termoterapia superficial (paquete caliente). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPEUTICO:\r\nCaminata en banda sin fin.\r\nFortalecimiento muscular a través de ejercicios uniplanares con resistencia externa: bandas elásticas (amarilla) y/o equipos de suspensión como TRX o autocargas en cadenas cinética cerrada y abiertas.\r\nEjercicios de coordinación, propiocepción y balance: desplazamientos en escalerillas, caminata en puntas de pie y en talones, ejercicio de apoyo unipodal sobre superficie estable e inestable, ejercicio de alcance anterior en apoyo unipodal, puente en apoyo unipodal, Ejercicios de balance en balón.\r\nEstiramiento mantenido. \r\n\r\n','Esguince recidivante de tobillo izquierdo. ','2017-11-08','Paciente de género masculino de 10 años de edad, con diagnóstico médico de esguince recidivante de ligamentos externos del tobillo izquierdo de un año de evolución. Quien finaliza tratamiento de fisioterapia después de 10 sesiones, a la revaloración el paciente refiere exacerbación del dolor durante el movimiento que puede estar relacionada con la actividad deportiva (futbol) realizada hace unos días. Ausencia de espasmos musculares, mejoramiento en la fuerza muscular de los peroneos. Disminución de las retracciones musculares de gastronecmios e isquiotibiales, bilateralmente. Sin embargo reaparece patrón de marcha asimétrico con presencia de mayor toma de peso en el miembro inferior derecho, disminución del choque de talón izquierdo. \r\n\r\n',6),(40,28,'2017-10-30 23:39:10','particular',12,'2017-09-27','Paciente masculino de 25 años de edad, quien llega al consultorio refiriendo dolor severo en zona bipatelar en reposo de 7/10,  hace 7 meses de evolución, a valoración refiere dolor de 4/10 a palpación en cóndilo femoral medial izquierdo y 6/10 sobre cóndilo femoral derecho, 7/10 al movimiento activo de flexión de rodilla derecha y 6/10 al movimiento activo de flexión en rodilla izquierda, presenta edema leve y se corrobora con perimetría registrando 0,5 cm comparativamente  intrarticular en rodilla derecha, con atrofia de cuadriceps e isquiotibiales de 1 cm a comparacion de grupo muscular femoral izquierdo,espasmos moderados en zona de vastos laterales femorales  y gastrosoleos bilateralmente, retracciones moderadas para musculatura de zona lumbar, cuadriceps, isquiotibiales y gastrosoleos bilateralmente, restricción a los arcos de movimiento pasivo en flexión de rodilla derecha de 0-110° con sensación final vació, y flexión de rodilla izquierda de 0-120° con sensación final firme, buena fuerza muscular para flexores y extensores de rodilla bilateralmente. En Postura vista posterior  presenta rodillas en varo , descenso del arco plantar en apoyo en pie izquierdo, postura en vista lateral presenta hiperextesión en rodillasy vista anterior pies bilateralmente en eversión. Marcha antalgica, sin aditamentos, buena coordinación y  regular propiocepción en miembros inferiores, registrando 15 segundos en equilibrio unipodal con dificultad para mantener dicha postura.  lo anterior si limita su funcionalidad en actividades de desplazamiento y lo restringe su participación en su rol laboral y ludico- recreativas ','Criomasaje: Masaje cubo de hielo\r\nUltrasonido, pulsátil \r\nTENS, \r\nTermoterapia: Paquete caliente \r\nMasaje de drenaje y sedación \r\nEntrenamiento de marcha sobre colchoneta  \r\nEjercicios de Entrenamiento funcional\r\nEntrenamiento con TRX. ','Hiperpresión Bipatelar ','2017-10-27',NULL,4),(41,108,'2017-10-30 23:44:47','particular',5,'2017-10-24','Paciente masculino de 67 años de edad, quien llega al consultorio refiriendo dolor severo en zona patelar izquierda lateral y posterior de 7/10,  hace 5 años de evolución, antecedente traumatico por fractura de platillos tibiales izquierdo, en estado de resolución total con material de osteosintesis,  a valoración refiere dolor de 7/10 a palpación en cóndilo femoral lateral izquierdo y 6/10 en zona poplitea derecho, 5/10 al movimiento activo de flexión de rodilla  izquierda, presenta edema severo y se corrobora con perimetría registrando 2 cm comparativamente  intrarticular en rodilla derecha, y 4 cm infra-articular de la misma rodilla. Con atrofia de cuadriceps e isquiotibiales de 1 cm a comparacion de grupo muscular femoral derecho, retracciones moderadas para musculatura de zona lumbar, cuadriceps, isquiotibiales y gastrosoleos bilateralmente, restricción a los arcos de movimiento pasivo en flexión de rodilla izquierda de 0-130° con sensación final vacia,  buena fuerza muscular para flexores y extensores de rodilla bilateralmente. En Postura vista posterior  presenta rodillas en valgo , descenso del arco plantar en apoyo en pie izquierdo, postura en vista lateral presenta hiperextesión en rodillasy vista anterior pies bilateralmente en eversión. Marcha antalgica, sin aditamentos, buena coordinación y  regular propiocepción en miembros inferiores, en equilibrio unipodal con dificultad para mantener dicha postura.  lo anterior si limita su funcionalidad en actividades de desplazamiento y lo restringe su participación en su rol laboral y ludico- recreativas. ','Criomasaje: Masaje cubo de hielo\r\n\r\nMasaje de drenaje y sedación \r\nEntrenamiento de marcha sobre colchoneta  \r\nEjercicios de Entrenamiento funcional\r\nEstiramientos pasivos en miembros inferiores y lumbares \r\nBalonterapia ','Vasculitis femoral y poplitea de miembro inferior izquierdo','2017-10-31',NULL,4),(42,112,'2017-11-08 14:43:02','Dr. Juan Camilo Mantilla',10,'2017-11-02','Paciente de género masculino de 37 años de edad, con diagnóstico médico de esguince de ligamentos externos del tobillo derecho de tres semanas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región anterior del maléolo lateral del tobillo derecho de intensidad 6/10 a la palpación y de 7/10 a los movimientos de inversión y en bipedestación prolongada según la escala numérica verbal. Presenta espasmos en músculos peroneos, tibial anterior y gastronecmios del miembro inferior derecho. Presenta edema de 3 cm de diferencia localizado 4 cm hacia abajo del maléolo lateral izquierdo. Disminución del rango de movimiento de inversión (0°-25°) con sensación final vacío por presencia de dolor. Fuerza muscular de 4 para peroneos y plantiflexores derechos. Retracciones musculares leves de isquiotibiales bilateralmente. El paciente es independiente para las actividades de la vida diaria, pero presenta restricción en la participación en su rol laboral y recreativo. ','Caminata en banda sin fin (velocidad 2 km/hr)\r\n\r\nFortalecimiento muscular a través de ejercicios uniplanares con resistencia externa: bandas elásticas (amarilla) y/o equipos de suspensión como TRX o autocargas en cadenas cinética cerrada y abiertas.\r\n\r\nEjercicios de coordinación, propiocepción y balance: desplazamientos en escalerillas, ejercicio de apoyo unipodal sobre superficie estable e inestable, ejercicio de alcance anterior en apoyo unipodal. \r\n\r\nEstiramiento mantenido. \r\n','Esguince de ligamentos laterales del tobillo derecho','2017-11-23','El paciente finaliza 10 sesiones de fisioterapia, a la revaloración presenta disminución del dolor en región anterior del maléolo lateral del tobillo derecho de intensidad 3/10 a la palpación y de 4/10 al final del rango de movimiento de inversión, según la escala numérica verbal. No presenta estamos, ni edema. Aumento de la movilidad articular de inversión (0°-35°). Disminución de las retracciones musculares de isquiotibiales bilateralmente. El paciente es independiente para las actividades de la vida diaria, pero presenta leve restricción en la participación en su rol laboral. ',6),(43,113,'2017-11-08 14:46:28','Dra. Erika Margarita Aguirre',10,'2017-11-07','Paciente de género masculino de 67 años de edad, con diagnóstico médico de lumbago no especificado de tres semanas de evolución. A la evaluación fisioterapéutica inicial presenta dolor en región lumbar de intensidad 2/10 a la palpación y de 6/10 a los movimientos de flexión del tronco según la escala numérica verbal. Presenta espasmos en musculatura paravertebral lumbar y dorsal. Patrones de movimiento del tronco superior buenos por compromiso de la fuerza. A la evaluación de la fuerza muscular del tronco se encuentra nota de 3 para el recto anterior del abdomen, oblicuos mayor y menor derecho e izquierdo y extensores toracolumbares. A la evaluación de la longitud muscular presenta retracciones de la musculatura posterior (paravertebrales lumbares e isquiotibiales), de aductores y del recto anterior del cuádriceps bilateral en la prueba de Thomas. Pruebas de Lasegue y Bragar negativas. El paciente es independiente para todas las actividades de la vida diaria pero presenta dolor que lo limita para levantar un objeto del suelo y amarrarse los zapatos.  ','MODALIDADES FISICAS\r\nElectroterapia: TENS (nivel sensitivo confortable), Masaje sedativo, Termoterapia superficial (paquete caliente), Ultrasonido terapéutico (modo: continuo). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPÉUTICO:\r\nEstiramiento muscular mantenido: paravertebrales dorsales y lumbares, isquiotibiales, aductores de cadera, glúteos y musculatura lateral del tronco.\r\nEjercicio Cat-camel, ejercicio de anteversión y retroversión de la pelvis en supino sobre colchoneta. \r\nFortalecimiento muscular de de abdominales, extensores de tronco y glúteos. \r\n','Lumbago no especificado.','2017-11-21','El paciente finaliza tratamiento de fisioterapia después de 10 sesiones. A la revaloración fisioterapéutica no presenta dolor ni espasmos en región lumbar. Presenta disminución de las retracciones musculares de paravertebrales lumbares, isquiotibiales, de aductores y del recto anterior del cuádriceps bilateralmente. El paciente no presenta limitación para las actividades de la vida diaria. ',6),(44,115,'2017-11-08 14:54:02','Dr. Nelson Ivan Gonzales ',12,'2017-11-07','Paciente de género masculino de 36 años de edad, con diagnóstico médico de neuropatía focal compresiva del nervio ulnar en codo bilateral, de tres meses de evolución.  A la evaluación fisioterapéutica inicial no refiere dolor, presenta parestesias en 4° y 5° dedo bilateralmente. Presenta espasmos en musculatura flexora de muñeca y dedos y bíceps braquial. Rangos de movilidad articular de a muñeca y dedos dentro de los valores normales. A la evaluación de la fuerza no se encuentra alteración. El paciente es independiente en todas las actividades de la vida diaria, pero presenta limitación para el uso del computador y celular. ','MODALIDADES FÍSICAS:\r\nUltrasonido terapéutico (pulsado), Crioterapia (criomasaje), Masaje sedativo, Termoterapia superficial (paquete caliente). \r\n\r\nMODALIDADES DEL EJERCICIO TERAPÉUTICO:\r\nEstiramiento muscular mantenido: flexores de muñeca, pronadores, triceps, pectoral.\r\nEstiramientos neurodinamicos\r\n','Neuropatía focal compresiva del nervio ulnar  bilateral.','2017-12-01','Paciente finaliza orden de fisioterapia, después de 12 sesiones. A la revaloración refiere disminución de parestesias en 4° y 5° dedo bilateralmente, las cuales son ocasionales. Ausencia de espasmo. Movilidad articular de muñeca y dedos conservada. Fuerza muscular de muñeca y dedos sin compromiso. El paciente es independiente en todas las actividades de la vida diaria, con menor limitación para el uso del computador y celular.',6),(45,117,'2017-11-15 20:37:50','Particular',5,'2017-11-14','Paciente de género femenino de 54 años de edad, con diagnóstico médico de cervicalgia de tres meses de evolución.  A la evaluación fisioterapéutica refiere dolor región cervical de intensidad 7/10 a la palpación y de 5/10 cm al movimiento de rotación e inclinación lateral del cuello, según la escala numérica verbal de dolor. Presenta espasmos en fibras superiores y medias del trapecio, paravertebrales cervicales y romboides. A la evaluación de los patrones de movimiento presenta patrones buenos para cabeza y cuello por compromiso de la movilidad por presencia de dolor. A la evaluación de la movilidad articular de la columna cervical se encontró disminución de los movimientos de flexión (0 a 40 grados),  inclinación lateral derecha e izquierda (0 a 40 grados), rotación (0-60 derecha e izquierda). La paciente es independiente en todas las actividades de la vida diaria, pero presenta dolor que la limita durante el uso del computador.','MODALIDADES FISICAS\r\nTermoterapia superficial: (Paquete caliente), Termoterapia profunda: Ultrasonido Terapéutico (Modo de aplicación: continuo), Electroterapia: TENS (nivel sensitivo confortable), Masaje sedativo.\r\n\r\nEJERCICIO TERAPÉUTICO\r\nEstiramiento mantenido: Musculatura de cuello, hombro y escapula.\r\nSostener-relajar\r\nIsométricas alternas y estabilizaciones rítmicas. \r\n','Cervicalgia','2017-11-20','La paciente finaliza tratamiento de fisioterapia después de 5 sesiones. A la revaloración se encuentra disminución del dolor en región cervical de 2/10 a la palpación y al movimiento de inclinación lateral del cuello, según la escala numérica verbal de dolor. Ausencia de espasmos, aumento del rango de movimiento de rotación del cuello (0 a 70 grados) bilateralmente. Disminución de la limitación funcional durante el uso del computador. ',6),(46,118,'2017-11-15 20:40:38','Dr. Carlos Hernando Rico',10,'2017-11-15','Paciente de género masculino de 76 años de edad, con diagnóstico médico de síndrome del manguito rotador del hombro derecho. A la evaluación fisioterapéutica inicial no presenta dolor al reposo ni al movimiento del hombro, presenta espasmos en trapecio fibras superiores y medias y bíceps braquial derecho. Se realizan pruebas específicas para hombro: arco doloroso, test de Neer, test de Kennedy Hawkins, maniobra de Jobe y de Patte con resultados negativos. Movilidad articular del hombro dentro de los valores normales: flexión (0°-180°), extensión (0°-50°), abducción (0°-170°), aducción (170°-0°), rotación interna (0°-70°), rotación externa (0°-80°). Patrones de movimiento buenos para el miembro superior izquierdo con mayor compromiso de la fuerza del pivote proximal. Retracciones musculares leves para el pectoral mayor y dorsal ancho bilateral. Presenta notas musculares de 4 para deltoides anterior y posterior, romboides y para rotadores externos del hombro derecho. No presenta imitación funcional ni restricción en la participación en sus roles. ','MODALIDADES FISICAS\r\nTermoterapia superficial (paquete caliente), Electroterapia (TENS nivel sensitivo),  masaje terapéutico.\r\n\r\nMODALIDADES DEL EJERCICIO\r\nEstiramiento  mantenido de los miembros superiores, ejercicios de Codman con mancuerna de 3 lb,  ejercicios de fortalecimiento con mancuernas de 1 y 2 lb para miembros superiores, fortalecimiento de cintura escapular en multifuerza.','Síndrome del manguito rotador derecho ','2017-11-29','Paciente finaliza orden de fisioterapia después de 10 sesiones, a la revaloración continua sin dolor, no presenta espasmos musculares, pruebas específicas de hombro con resultados negativos. Movilidad articular conservada. Patrones de movimiento buenos, disminución de retracciones musculares del pectoral mayor y dorsal ancho bilateralmente. No presenta imitación funcional ni restricción en la participación en sus roles.  ',6),(47,111,'2017-11-19 20:41:50','Particular',3,'2017-11-07','Paciente de género femenino de 62 años de edad, quien consulta por dolor en arco plantar bilateral de mayor compromiso izquierdo, que aparece posterior al movimiento del pie y la caminata rápida, ademas refiere presencia de dolor  lumbar. A la evaluación fisioterapéutica refiere dolor localizado en arcos plantares de mayor intensidad al movimiento,  dolor en región lumbar de mayor intensidad a la palpación de la zona, presenta espasmos en gastronecmios bilateralmente y paravertebrales lumbares. Se observan pies planos, arcos de movilidad articular del tobillo dentro de los valores normales. En la evaluación postural se encuentra en la vista anterior hombro derecho descendido, cadera elevada del lado derecho, leve genu valgo, tibias varas y pies planos; en la vista posterior se corroboran hallazgos encontrados en la vista anterior y adicionalmente posible escoliosis dorsolumbar izquierda. En la vista lateral: hipercifosis cervical, hiperlordosis lumbar, protrucción de hombros y abdominal, hiperextensión de rodillas.','PLAN DE TRATAMIENTO:\r\n\r\nMODALIDADES FISICAS\r\nTermoterapia superficial (Paquete caliente), Electroterapia: TENS (nivel sensitivo confortable), Masaje sedativo, Crioterapia (criomasaje).\r\n\r\nEJERCICIO TERAPÉUTICO\r\nEstiramiento mantenido.\r\n','Sin diagnóstico médico','2017-11-10','Después de realizadas 3 sesiones de fisioterapia la paciente refiere persistencia del dolor en planta del pie, ausencia de espasmos musculares en región lumbar y de plantiflexores. Por lo anterior se sugiere valoración médica para determinar un diagnóstico y plan de manejo. ',6),(48,125,'2017-12-21 18:38:14','particular',1,'2017-12-09','Paciente que asiste a consulta para valoración fisioterapeutica por presentar cuadro crónico de dolor lumbar. Refiere antecedente de hernia discal lumbar. A la evaluación se encuentra dolor de 8/10 en la EAV ubicado en zona lumbar irradiado a glúteo de predominio derecho, al reposo y al movimiento. Espasmos severos en paravertebrales dorsolumbares y glúteo de predominio derecho, inflamación marcada en dicha zona, limitación de la movilidad para la flexión y extensión del tronco, retracciones leves de isquiotibiales, plantiflexores, tensor de la fascia lata y rotadores externos de cadera, de predominio derecho, debilidad de musculatura paravertebral dorsal y abdominal.\r\nEn la valoración postural se observa descenso de hombro izquierdo, ascenso de cadera derecha, lo que indica posible escoliosis dorsal derecha y compensada lumbar izquierda, marcada hiperlordosis lumbar y leve protrucción abdominal.\r\nLlega al servicio con marcha antálgica y gran dificultad para realizar cambios de postura.','Criomasaje, ultrasonido continuo, TENS modalidad normal, paquete caliente, masaje terapéutico de relajación, TFNP isométricas alternas, estabilización rítmica, estiramientos mantenidos generalizados por patrones.','Lumbalgia','2017-12-09','Desde el punto de vista de la valoración Fisioterapéutica se recomienda seguir con fisioterapia y cuidados posturales: No levantar objetos pesados, no trabajar en posturas extremas por largo tiempo, realizar pausas activas durante su trabajo y evitar movimientos de rotación del tronco.',2);

/*Table structure for table `cliente_sub_paquete` */

DROP TABLE IF EXISTS `cliente_sub_paquete`;

CREATE TABLE `cliente_sub_paquete` (
  `id_cliente_sub_paquete` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id del sub paquete cliente',
  `id_cliente` int(11) unsigned NOT NULL COMMENT 'Id del cliente',
  `id_sub_paquete` int(11) unsigned NOT NULL COMMENT 'Id del sub paquete',
  `fecha_inicio` datetime NOT NULL COMMENT 'fecha de inicio',
  `estado` smallint(1) NOT NULL DEFAULT '1' COMMENT 'estado',
  `fecha_pago` date DEFAULT NULL COMMENT 'fecha de pago',
  `descuento` double(10,2) DEFAULT NULL COMMENT 'descuento realizado',
  `total_pagar` double(10,2) DEFAULT NULL COMMENT 'total a pagar',
  `fecha_modificacion` date DEFAULT NULL COMMENT 'fecha modificacion',
  `numero_excusas` smallint(2) NOT NULL DEFAULT '0' COMMENT 'numero de excusas usadas',
  `fecha_limite` date NOT NULL COMMENT 'fecha limite modificacion',
  PRIMARY KEY (`id_cliente_sub_paquete`),
  KEY `id_cliente_cliente_sub_paquete_idx` (`id_cliente`),
  KEY `id_sub_paquete_cliente_sub_paquete_idx` (`id_sub_paquete`),
  CONSTRAINT `id_cliente_cliente_sub_paquete_fk` FOREIGN KEY (`id_cliente`) REFERENCES `cliente` (`id_cliente`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `id_sub_paquete_cliente_sub_paquete_fk` FOREIGN KEY (`id_sub_paquete`) REFERENCES `sub_paquete` (`id_sub_paquete`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=360 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

