/*Table structure for table `paquete` */

DROP TABLE IF EXISTS `paquete`;

CREATE TABLE `paquete` (
  `id_paquete` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id del paquete',
  `nombre` varchar(45) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Nombre del paquete',
  `clases_concurrentes` smallint(2) unsigned DEFAULT NULL COMMENT 'Cantidad de clases al tiempo',
  `tipo_paquete` smallint(1) unsigned zerofill NOT NULL DEFAULT '2' COMMENT 'ETipoPaquete(1: personalizado; 2: Grupal; 3:Semipersonalizado)',
