  `porcentaje_pago` decimal(10,2) DEFAULT NULL COMMENT 'porcentaje para pago a terceros',
  PRIMARY KEY (`id_paquete`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

