/*Table structure for table `sesion_sub_paquete` */

DROP TABLE IF EXISTS `sesion_sub_paquete`;

CREATE TABLE `sesion_sub_paquete` (
  `id_sesion_sub_paquete` bigint(30) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id de la tabla',
  `id_cliente_sub_paquete` int(11) unsigned NOT NULL COMMENT 'id cliente subpaquete',
  `id_representante` int(11) unsigned DEFAULT NULL COMMENT 'id usuario instructor',
  `fecha_registro` date NOT NULL COMMENT 'fecha de registro',
  `estado` smallint(1) NOT NULL DEFAULT '2' COMMENT 'EEstadoSesion( 1:Activo; 2:pendiente; 3:Confirmada; 4:Modificada)',
  `fecha_hora_inicio` datetime DEFAULT NULL COMMENT 'fecha hora inicio',
  `fecha_hora_fin` datetime DEFAULT NULL COMMENT 'fecha hora fin',
  `fecha_modificacion` date DEFAULT NULL COMMENT 'fecha de modificacion',
  `numero` smallint(2) NOT NULL COMMENT 'numero de la sesion',
  `id_clase` int(11) unsigned DEFAULT NULL COMMENT 'id de la clase grupal',
  `fecha_clase` date DEFAULT NULL COMMENT 'fecha clase grupal',
  PRIMARY KEY (`id_sesion_sub_paquete`),
  KEY `id_cliente_sub_paquete_sesion_idx` (`id_cliente_sub_paquete`),
  KEY `id_usuario_sesion_idx` (`id_representante`),
  KEY `id_clase_sesion_idx` (`id_clase`),
  CONSTRAINT `id_clase_sesion_fk` FOREIGN KEY (`id_clase`) REFERENCES `clase` (`id_clase`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `id_cliente_sub_paquete_sesion_fk` FOREIGN KEY (`id_cliente_sub_paquete`) REFERENCES `cliente_sub_paquete` (`id_cliente_sub_paquete`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `id_usuario_sesion_idx` FOREIGN KEY (`id_representante`) REFERENCES `rh_representante` (`id_representante`) ON DELETE NO ACTION ON UPDATE NO ACTION
