/*Table structure for table `sub_paquete` */

DROP TABLE IF EXISTS `sub_paquete`;

CREATE TABLE `sub_paquete` (
  `id_sub_paquete` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id del subpaquete',
  `id_paquete` int(11) unsigned NOT NULL COMMENT 'Id del paquete padre',
  `nombre` varchar(45) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Nombre del subpaquete',
  `numero_sesiones` smallint(2) NOT NULL COMMENT 'Número de clases del paquete',
  `numero_excusas` smallint(1) NOT NULL COMMENT 'Número maximo de excusas',
  `yn_activo` smallint(1) NOT NULL DEFAULT '1' COMMENT 'ESiNo(1: Si; 2: No)',
  `precio` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT 'Valor del sub paquete',
  `duracion` smallint(1) NOT NULL COMMENT 'EDuracionPaquete(1: dia; 2:semana; 3:mes; 4:bimestre; 5:trimestre; 6:cuatrimestre; 7:semestre; 8:anual; )',
  `yn_tiquetera` smallint(1) unsigned NOT NULL DEFAULT '2' COMMENT 'ESiNo(1: Si; 2: No)',
  `numero_cliente` smallint(2) unsigned NOT NULL COMMENT 'Número de clientes asociados para paquetes semipersonalizados',
  `duracion_clase` smallint(2) unsigned NOT NULL DEFAULT '60' COMMENT 'Minutos de duracion de la clase',
  PRIMARY KEY (`id_sub_paquete`),
  KEY `id_paquete_sub_paquete_idx` (`id_paquete`),
  CONSTRAINT `id_paquete_sub_paquete_fk` FOREIGN KEY (`id_paquete`) REFERENCES `paquete` (`id_paquete`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

